/*** Remove FK Constraints ***/
/*** New method, checks if the tables exist before altering.
	 Should prevent the need to comment out alter tables during first run ***/

IF EXISTS (select * from INFORMATION_SCHEMA.TABLES WHERE TABLE_NAME = 'Courses')
	BEGIN
		ALTER TABLE [Courses]
		DROP CONSTRAINT IF EXISTS [FK_SubjectsID_Courses]
	END

IF EXISTS (select * from INFORMATION_SCHEMA.TABLES WHERE TABLE_NAME = 'CourseOfferings')
	BEGIN
		ALTER TABLE [CourseOfferings]
		DROP CONSTRAINT IF EXISTS [FK_ScheduleTypesID_CourseOfferings]
		ALTER TABLE [CourseOfferings]
		DROP CONSTRAINT IF EXISTS [FK_CourseTermsID_CourseOfferings]
		ALTER TABLE [CourseOfferings]
		DROP CONSTRAINT IF EXISTS [FK_ProfessorsID_CourseOfferings]
		ALTER TABLE [CourseOfferings]
		DROP CONSTRAINT IF EXISTS [FK_LocationsID_CourseOfferings]
		ALTER TABLE [CourseOfferings]
		DROP CONSTRAINT IF EXISTS [FK_CoursesID_CourseOfferings]
	END

IF EXISTS (select * from INFORMATION_SCHEMA.TABLES WHERE TABLE_NAME = 'Students')
	BEGIN
		ALTER TABLE [Students]
		DROP CONSTRAINT IF EXISTS [FK_MajorsID_Students]
	END

IF EXISTS (select * from INFORMATION_SCHEMA.TABLES WHERE TABLE_NAME = 'Requisites')
	BEGIN
		ALTER TABLE [Requisites]
		DROP CONSTRAINT IF EXISTS [FK_ForCourseID_Requisites]
		ALTER TABLE [Requisites]
		DROP CONSTRAINT IF EXISTS [FK_IsCourseID_Requisites]
	END

IF EXISTS (select * from INFORMATION_SCHEMA.TABLES WHERE TABLE_NAME = 'Subjects')
	BEGIN
		ALTER TABLE [Subjects]
		DROP CONSTRAINT IF EXISTS [FK_DepartmentsID_Subjects]
	END

IF EXISTS (select * from INFORMATION_SCHEMA.TABLES WHERE TABLE_NAME = 'CourseLocations')
	BEGIN
		ALTER TABLE [CourseLocations] 
		DROP CONSTRAINT IF EXISTS [FK_CampusID_CourseLocations]
	END

IF EXISTS (select * from INFORMATION_SCHEMA.TABLES WHERE TABLE_NAME = 'RequiredCourses')
	BEGIN
		ALTER TABLE [RequiredCourses]
		DROP CONSTRAINT IF EXISTS [FK_MajorsID_RequiredCourses]
		ALTER TABLE [RequiredCourses]
		DROP CONSTRAINT IF EXISTS [FK_CoursesID_RequiredCourses]
	END

IF EXISTS (select * from INFORMATION_SCHEMA.TABLES WHERE TABLE_NAME = 'EnrolledCourses')
	BEGIN
		ALTER TABLE [EnrolledCourses]
		DROP CONSTRAINT IF EXISTS [FK_StudentsID_EnrolledCourses]
		ALTER TABLE [EnrolledCourses]
		DROP CONSTRAINT IF EXISTS [FK_CourseOfferingsID_EnrolledCourses]
		ALTER TABLE [EnrolledCourses]
		DROP CONSTRAINT IF EXISTS [FK_GradesID_EnrolledCourses]
	END

IF EXISTS (select * from INFORMATION_SCHEMA.TABLES WHERE TABLE_NAME = 'CourseEvaluationsOnline')
	BEGIN
		ALTER TABLE [CourseEvaluationsOnline]
		DROP CONSTRAINT IF EXISTS [FK_EnrolledCoursesID_CourseEvaluationsOnline]
	END

IF EXISTS (select * from INFORMATION_SCHEMA.TABLES WHERE TABLE_NAME = 'CourseEvaluationsF2F')
	BEGIN
		ALTER TABLE [CourseEvaluationsF2F]
		DROP CONSTRAINT IF EXISTS [FK_EnrolledCoursesID_CourseEvaluationsF2F]
	END

IF EXISTS (select * from INFORMATION_SCHEMA.TABLES WHERE TABLE_NAME = 'CourseTerms')
	BEGIN
		ALTER TABLE [CourseTerms]
		DROP CONSTRAINT IF EXISTS [CHK_SubTermsDesc]
		ALTER TABLE [CourseTerms]
		DROP CONSTRAINT IF EXISTS [CHK_TermsDesc]
	END



