INSERT INTO Courses([CoursesID],[SubjectsID],[CourseTitle],[CourseDescription],[CourseNumber],[CreditHours],[Levels]) VALUES
 (1,26,'17th Centrury Literature','Poetry and prose of the 17th century.','B403',3,'Undergraduate')
,(2,26,'18th Century Literature','Poetry and prose of the 18th century.','B410',3,'Undergraduate')
,(3,6,'2-Dimensional Design','Introduction to visual thinking and principles of two-dimensional design.','B103',3,'Undergraduate')
,(4,6,'3-Dimensional Design','Introduction to the principles of three-dimensional design regarding concepts, materials, and spatial arrangement.','B104',3,'Undergraduate')
,(5,53,'Abnormal Behavior in Children','(Prerequisite: PSYC B311 or consent of instructor) Theories, description and assessment of child behavior problems and disorders; methods of intervention.','B312',3,'Undergraduate')
,(6,53,'Abnormal Psychology','(Prerequisite: PSYC B101) Covers the classification, diagnosis, etiological theories and treatments of the major mental and emotional disorders.','B311',3,'Undergraduate')
,(7,42,'Abstract Algebra I','(Prerequisite: Grade of C or better in MATH B230 and MATH B300) An introduction to algebraic structures. Introduction to group theory including subgroups, quotient groups, homomorphisms; introduction to rings including ideals, quotient rings, polynomial rings and fields of fractions. Offered Spring semester.','B410',3,'Undergraduate')
,(8,42,'Abstract Algebra II','(Prerequisite: Grade of C or better in MATH B410) A continuation of studies in Algebra. An introduction to modules and field theory including vector spaces, algebras and free abelian groups; introduction to field theory including algebraic extension, Galois theory and finite fields.','B411',3,'Undergraduate')
,(9,1,'Accounting Information Systems','(Prerequisite: Grade of C or higher in ACCT B226) Accounting systems for business decision-making and effective control of the business enterprise.','B345',3,'Undergraduate')
,(10,24,'Action Research for Literacy Coaching','Candidates will gain the skills to create, manage and evaluate school-wide reading programs. This includes learning adult learning theories, developing professional learning opportunities, and supervising the literacy program.','B645',3,'Graduate')
,(11,24,'Action Research for Literacy Education','Candidates will gain skills necessary for conducting action research in literacy education and coaching.  This includes assessing the needs of teacher/students, identifying research-based interventions, designing and implementing a coaching plan including identification of assessment to document effectiveness of plan, and assessing effectiveness of coaching plan.','B632',3,'Graduate')
,(12,26,'Adolescent Literature & Development','(Prerequisite: ENGL B101 or B105 & B102 or B106, and one literature course at the 200-level or higher, each with a grade of ''C'' or higher) Literature written for and about adolescents, examined through the critical lenses of psychological development, pedagogy, and publishing.','B432',3,'Undergraduate')
,(13,48,'Adult Health Nursing II','(Prerequisite: NURS B412, B418, B422C) This course will present advanced concepts in the care of high acuity and critically ill adult and elderly patients often seen in the intensive care setting. Cases analyzed will deal with high acuity illnesses, multi-systems failure, trauma, field-based communications and medical transfers. Technology to monitor, evaluate, and sustain life will be reviewed. Emphasis will be placed on Interprofessional collaboration to optimize care in the high acuity adult as well as adult palliative care and end-of-life care. Students will build confidence in rapid responses to dynamic changes in patient conditions and response. The psycho-social-support aspects of assisting families through highly vulnerable situations will be refined.','B425',3,'Undergraduate')
,(14,1,'Advanced Accounting','(Prerequisite: a grade of C or better in ACCT B426) The detailed study of special advanced topics of accounting, including (1) accounting for business mergers and consolidations, subsequent activities and consolidated reporting of financial information, (2) tax topics for business combinations, (3) relevant International Financial Reporting Standards, (4) accounting for legal reorganizations and liquidations, and (5) accounting for partnership formations, operations, and terminations.','B437',3,'Undergraduate')
,(15,6,'Advanced Ceramics','(Prerequisite: ARTS B102, B103, B104, B111, and B321) Further development of throwing and hand-building skills. Introduction to kiln firing and continued glaze and clay experimentation. Can be repeated for a total of 6 credit hours.','B420',3,'Undergraduate')
,(16,35,'Advanced Club Management','(Prerequisite. HRTM B285 or consent of instructor) Advanced topics in hospitality management for the club industry.','B485',3,'Undergraduate')
,(17,57,'Advanced Composition and Grammar','(Prerequisite: FREN B201 or equivalent or consent of instructor; FREN B202 strongly recommended) Practice in French composition; intensive review of French grammar.','B302',3,'Undergraduate')
,(18,29,'Advanced Composition and Grammar','(Prerequisite: Grade of C or better in SPAN B202 by Phase II placement exam, or consent of instructor. Department consent required for transfer students.) Advanced practice of reading and writing in Spanish with an intensive review of Spanish grammar.','B302',3,'Undergraduate')
,(19,57,'Advanced Conversation and Grammar','(Prerequisite: FREN B202 or equivalent or consent of instructor; FREN B201 strongly recommended) Current issues and events presented in French language media. Discussion and presentations in French provide practice with advanced structures and idiomatic speech.','B301',3,'Undergraduate')
,(20,29,'Advanced Conversation and Grammar','(Prerequisite: Grade of C or better in SPAN B202 by Phase II placement exam, or consent of instructor. Department consent required for transfer students.) Advanced practice of speaking and listening in Spanish with an intensive review of Spanish grammar.','B301',3,'Undergraduate')
,(21,6,'Advanced Digital Photography','(Prerequisite: ARTS B102, B103, B104, B111, and B364) This course will focus on individual development in photography. Can be repeated for a total of 6 credit hours.','B465',3,'Undergraduate')
,(22,9,'Advanced Directed Studies in Biology','(Prerequisite: One course from BIOL B301, B302 or B303 with a grade of C or better) Study of a topic not otherwise available to student. May involve reading assignments, tutorial, lectures, papers, presentations, or field or laboratory study, determined in consultation with instructor. Repeatable to a maximum of 6 credit hours.','B395',1,'Undergraduate')
,(23,6,'Advanced Drawing','(Prerequisite: ARTS B102, B103, B104, B111, and B330) Execution of advanced techniques in drawing utilizing emerging and contemporary practices. Emphasis on personal expression. Can be repeated for a total of 6 credit hours','B370',3,'Undergraduate')
,(24,6,'Advanced Drawing II','(Prerequisite: ARTS B102, B013, B104, B111, and B430) Development of highly individualized content in a series of drawings.','B431',3,'Undergraduate')
,(25,23,'Advanced Educational Psychology','(Prerequisite: Permission of Department) This course will introduce and illustrate the proper use of learning theories in providing insights into defining and solving problems that may be encountered in educational settings. The emphasis will be on the use of these theories to solve realistic and relevant problems drawn from the classroom teachers own personal experience or from cases in the readings.','B635',3,'Graduate')
,(26,53,'Advanced Independent Study','(Prerequisite: 9 hours of psychology and consent of instructor) Closely supervised project or research experience in psychology. Approved contract required. May be repeated for up to six credits.','B498',3,'Undergraduate')
,(27,6,'Advanced Painting','(Prerequisite: ARTS B102, B103, B104, B111, and B311) An advanced opportunity to develop according to one''s interests. Can be repeated for a total of 6 credit hours.','B412',3,'Undergraduate')
,(28,6,'Advanced Printmaking','(Prerequisite: ARTS B102, B103, B104, B111, and B316) The processes and materials of making fine prints. Can be repeated for a total of 6 credit hours.','B417',3,'Undergraduate')
,(29,53,'Advanced Research Methods in Psychology','(Prerequisite: PSYC B200 and [PSYC B202 or SOCY B220 or STAT B201]) This course provides an integration of research methods and statistical methods. Students will design and complete a psychology research project.','B494',3,'Undergraduate')
,(30,6,'Advanced Sculpture','(Prerequisite: ARTS B102, B103, B014, B111, and B325) This course will focus on individual development in the form of sculpture. Can be repeated for a total of 6 credit hours.','B427',3,'Undergraduate')
,(31,57,'Advanced Spanish for Business and The Professions','(Prerequisite: SPAN B316 or consent of instructor) Vocabulary, concepts and oral/written skills necessary to communicate effectively in the social, cultural, or economic infrastructure of Hispanic countries. Introduction to the use of technology for the acquisition and processing of materials relevant to students professional goals. Taught in Spanish.','B417',3,'Undergraduate')
,(32,13,'Advanced Statistical Methods','{STAT B501} (Prerequisite: STAT B340 [or demonstrated equivalent knowledge/experience] or consent of instructor) Methods of data description and analysis, regression and spectral techniques, graphical presentation, estimation and forecasting. Statistical software will be used throughout the course.','B501',3,'Graduate')
,(33,51,'Advanced Topics and Physics','Study of a topic not otherwise available to student. May involve reading assignments, tutorial, lectures, papers, presentations, or field or laboratory study, determined in consultation with instructor. Repeatable to a maximum of 8 credit hours.','B398',3,'Undergraduate')
,(34,10,'Advanced Topics in Chemistry','Study of a topic not otherwise available to student. May involve reading assignments, tutorial, lectures, papers, presentations, or field or laboratory study, determined in consultation with instructor. Repeatable to a maximum of 8 credit hours.','B398',3,'Undergraduate')
,(35,13,'Advanced Topics in Database Systems','(Prerequisite: CSCI B320 [or demonstrated equivalent knowledge/experience], or consent of instructor) Advanced data-processing techniques, software, database design, implementation, and manipulation.','B520',3,'Graduate')
,(36,11,'Advocacy and Opposition','(Prerequisite: COMM B140) Major focus on models of argument and how they are presented in various communication contexts. Student debating included.','B325',3,'Undergraduate')
,(37,49,'Aerobic Fitness','Participate in aerobic fitness activities designed to improve cardiovascular endurance. Includes aerobic fitness assessment along with individualized and group aerobic fitness training.','B107',1,'Undergraduate')
,(38,33,'Africa from 1880','A history of modern Africa from the time of the Imperialist scramble of the 1880s to nationalism and decolonization in the present.','B352',3,'Undergraduate')
,(39,33,'African Diaspora','History of African in the America''s from 16th century to the present. Special emphasis on the experiences of Africans in South Carolina and the Sea Islands.','B351',3,'Undergraduate')
,(40,26,'African-American Literature','Representative works of African-American writers.','B428',3,'Undergraduate')
,(41,33,'Age of Renaissance','Social, cultural, and artistic movements in Italy and northern Europe from the Black Death (c. 1350) to religious reforms and revolutions (c. 1520).','B309',3,'Undergraduate')
,(42,33,'Age of the Reformation','Ecclesiastical institutions, religious experience and efforts at reform before Luther; career and theology of Luther; diffusion of Reformation throughout Europe; career and theology of Calvin; Catholic renewal and response.','B310',3,'Undergraduate')
,(43,26,'American Drama','Representative plays from the 18th century to the present.','B424',3,'Undergraduate')
,(44,33,'American Legal History','(Prerequisite: One of the following: HIST B101, B102, B111, B112, B115, B116. HIST B111 or B112 is preferred) A survey in American legal history, themes will include but are not confined to constitutional law, the impact of industrialism and the internationalization of law in the 20th century. Course includes REACH Act Founding Documents.','B469',3,'Undergraduate')
,(45,26,'American Literature 1830-1860','Poetry and prose of the American Romantic period.','B421',3,'Undergraduate')
,(46,26,'American Literature 1860-1910','Poetry and prose from the Civil War to the early modern era.','B422',3,'Undergraduate')
,(47,26,'American Literatures','(Prerequisite: ENGL B101 or B105, and ENGL B102 or B106, each with a C or higher.) Survey of American literatures; authors, genres and periods. Appropriate for students from any discipline.','B287',3,'Undergraduate')
,(48,33,'American Military Experience','Transformation of war and of the institutions for waging war from the American Revolution to the present.','B468',3,'Undergraduate')
,(49,52,'American National Government','The formation and development of the national government, its organization and powers.','B201',3,'Undergraduate')
,(50,50,'American Philosophy','The principal movements of philosophical thought from Colonial times to the present, with special emphasis on the 19th and 20th centuries.','B302',3,'Undergraduate')
,(51,42,'Analysis I','(Prerequisite: grade of C or better in MATH B300 or consent of instructor) A rigorous treatment of topics introduced in elementary calculus and more advanced topics basic to the study of real analysis. Offered Spring semester.','B450',3,'Undergraduate')
,(52,42,'Analysis II','(Prerequisite: grade of C or better in MATH B450 or consent of department) An introduction to the theory of several variables calculus: convergence in Euclidean spaces, functions on Euclidean spaces, differentiation in several variables, integration in several variables.','B451',3,'Undergraduate')
,(53,55,'Anthropology of Magic and Religion','{ANTH B352} A comparative examination of such topics as ritual, cosmology, revitalization movements, magic, witchcraft, myth and possession.','B360',3,'Undergraduate')
,(54,3,'Anthropology of Magic and Religion','{RELG B360} A comparative examination of such topics as ritual, cosmology, revitalization movements, magic, witchcraft, myth and possession. (Satisfies USCB General Education Global Citizenship and Multicultural Understanding Requirement).','B352',3,'Undergraduate')
,(55,3,'Anthropology of Tourism','Drawing on tourism destinations, development agendas, and societies from around the globe, this course will critically examine the relationship between tourism and cultural identities and economies.','B344',3,'Undergraduate')
,(56,9,'Applied Enviromental Science','Basic ecological principles on the functions and values of natural systems and how to apply those principles to designing the built environment in concert with nature.','B271',3,'Undergraduate')
,(57,53,'Applied Psychology','Uses of psychological knowledge and techniques in practical contexts; clinical, school, industrial, consumer and environmental psychology.','B212',3,'Undergraduate')
,(58,56,'Applied Sociology','(Prerequisite: SOCY B101 or consent of instructor) Introduces students to the uses of sociological concepts, skills and tools to actively analyze and engage problems facing a variety of clients and organizations including business, government, religion and other community agencies and groups. Emphasizes case studies and hands-on experience to identify, investigate and actively seek solutions to issues of structure, process and social change.','B314',3,'Undergraduate')
,(59,60,'Asian Theaters','(Prerequisite: ENGL B101 or B105, and ENGL B102 or B106, each with a C or higher) A survey of the theatrical genres and practices of Japan, China, Indonesia, and India.','B303',3,'Undergraduate')
,(60,24,'Assessment & Instructional Strategies for Reading for ELLs','(Prerequisite: Department Permission) This course focuses on determining reading and language needs of English learners through the use of screening and diagnostic assessments and using that information to inform teaching of English learners within the classroom setting. Candidates learn to administer quick assessments and design instruction and how instruction varies and students acquire language. Candidates choose one student''s data to present in a case study format.','B624',3,'Graduate')
,(61,48,'Assessment and Physical Examination of Individuals','(Prerequisite: Acceptance to the Pre-licensure program, RN licensure or consent of instructor) Students will conduct a systematic patient examination to determine the health, health risk, and health alterations from disease conditions. The focus is on adults with normal physiologic variation and extends to include age, gender, and socio-cultural variants. Using assessment findings students will derive clinical problem statements, determine risk reduction strategies, and align assessment findings with laboratory and other diagnostic results to create a comprehensive health profile.','B312',3,'Undergraduate')
,(62,24,'Assessment of Literacy for Early Childhood and Elementary Teachers','(Prerequisite: Admission to the Professional Program in Education or consent of the Department Chair, and EDCI B100, EDCI B243, and EDRD B318; Corequisite: EDRD B430 or B433, and EDRD B450P) This course instructs teacher candidates to administer and analyze a variety of formal and informal assessments for screening and diagnosis of reading problems at the early childhood and elementary level. The course utilizes both standardized and portfolio assessments. Offered in Spring.','B425',3,'Undergraduate')
,(63,24,'Assessment Strategies for Reading Assessment Strategies for Reading','Teachers will examine various types of assessments that will determine students strengths and areas for further instruction. Teachers will analyze existing data from multiple levels: individual students, groups of students (class level), grade levels, school, district, state, and national level data. They will explain assessment results and demonstrate the ability to advocate for appropriate literacy practices to relevant stakeholders. Teachers will also be able to locate and administer non-biased assessments to culturally and linguistically diverse student. This course aligns with Read to Succeed Legislation requirements for in-service teachers.','B625',3,'Graduate')
,(64,1,'Auditing','(Prerequisites: ACCT B426, STAT B201) Principles of auditing necessary to evaluate the integrity of accounting systems and financial reporting.','B485',3,'Undergraduate')
,(65,9,'Bacteriology','(Prerequisite: a grade of C or better in two of the three core courses: BIOL B301, B302, B303; Co-requisite BIOL B431L) An introduction to bacteria and viruses emphasizing ultrastructure, physiology, genetics and growth. Discussion of public health, industrial and environmental microbiology. Three lecture hours per week.','B431',3,'Undergraduate')
,(66,9,'Bacteriology Laboratory','(Co-requisite: BIOL B431) Three laboratory hours per week.','B431L',1,'Undergraduate')
,(67,42,'Basic Concepts of Elementary Mathematics','(Prerequisite: Qualification through placement or a grade of C or better in MATH B111 or B115) The meaning of number, fundamental operations of arithmetic, the structure of the real number system and its subsystems, elementary number theory. Open only to students in elementary or early childhood teacher certification. Offered every semester.','B221',3,'Undergraduate')
,(68,42,'Basic Concepts of Elementary Mathematics II','(Prerequisite: MATH B221) Informal geometry and basic concepts of algebra. Open only to students in elementary or early childhood teacher certification. Offered every semester.','B222',3,'Undergraduate')
,(69,54,'Basic Health','This course is a basic health course in which students will learn about strategies to improve health. Nutrition, fitness, drugs, and sexuality are some of the topics discussed. Career opportunities within the health field will be explored.','B101',3,'Undergraduate')
,(70,49,'Basketball','Fundamental skills of game performance. Strategy, rules, and basic offenses and defenses.','B112',1,'Undergraduate')
,(71,29,'Beginning French I','(Admission is restricted to those who have never studied French, or who have not studied French in the previous five years, or who test into this course in the USCB placement exam.) Introduction to grammar and practical vocabulary necessary for fundamental communication skills.','B101',3,'Undergraduate')
,(72,29,'Beginning French II','(Prerequisite: FREN B101 or by placement) Introduction to grammar and practical vocabulary necessary for fundamental communication skills.','B102',3,'Undergraduate')
,(73,31,'Beginning German','Introduction to grammar and practical vocabulary necessary for fundamental communication skills.','B101',3,'Undergraduate')
,(74,31,'Beginning German II','(Prerequisite: GERM B101) Introduction to grammar and practical vocabulary necessary for fundamental communication skills.','B102',3,'Undergraduate')
,(75,57,'Beginning Spanish I','(Admission is restricted to those who have never studied Spanish previously or who have placed by examination into 101) Introduction to grammar and practical vocabulary necessary for fundamental communication skills.','B101',3,'Undergraduate')
,(76,57,'Beginning Spanish II','(Prerequisite: SPAN B101 or by placement) Introduction to grammar and practical vocabulary necessary for fundamental communication skills.','B102',3,'Undergraduate')
,(77,36,'Beyond the Classroom: Community Project I','(Prerequisite: IDST major or approval of instructor. Junior standing.) Explores foundations of service learning. Theoretical approach to design and implementation of service learning project in and around the university, with emphasis on community outreach.','B351',3,'Undergraduate')
,(78,36,'Beyond the Classroom: Community Project II','The application of theoretical foundations and service learning in a community project designed in IDST B351, implemented as individual or group project.','B352',3,'Undergraduate')
,(79,55,'Biblical History and Literature','A brief introduction to contemporary study of the Bible, its historical background, writing and transmission, its principal persons, events and ideas and their significance for the present time.','B111',3,'Undergraduate')
,(80,50,'Bioethics','The concepts of Person and Justice as they relate to biomedical sciences and technologies.','B312',3,'Undergraduate')
,(81,9,'Biological Oceanography','(Prerequisite: a grade of C or better in two of the three core courses: BIOL B301, B302, B303) Capstone course for the Marine Biology degree program that is an interdisciplinary introduction to biological oceanography. The course integrates physical, chemical, geological and biological principles into an overview of oceanic processes, with an emphasis on the influence of organisms on biogeochemical cycles. 3-50 minute lectures and 2.8-hour laboratory each week.','B450',4,'Undergraduate')
,(82,9,'Biological Principles I','Introductory survey of cell structure and function, genetics and evolution. For biology majors, premed students and others needing a prerequisite in biological sciences. Three lecture hours and three laboratory hours per week.','B101',4,'Undergraduate')
,(83,9,'Biological Principles II','Introductory survey of plant and animal systems, principles of development, physiology, reproduction and ecology. Three lecture hours and three laboratory hours per week.','B102',4,'Undergraduate')
,(84,53,'Biological Psychology','(Prerequisite: PSYC B101) The neurochemical and neuroanatomical bases of behavior ranging from the reflex to schizophrenia. Satisfies 3-credit hour course requirement for Natural Science GE.','B361',3,'Undergraduate')
,(85,9,'Biological Research: An Introduction','(Prerequisite: a grade of C or better in two of the three core courses: BIOL B301, B302, B303) Methodologies of biological research with emphasis on hypothesis formation, research design and data collection and current issues in biology. Two lecture and six laboratory hours per week.','B498',4,'Undergraduate')
,(86,9,'Biology Honors Seminar','(Prerequisite: Acceptance in the Biology Honors program) This seminar will be an introduction to topics, information, reading and class field trips to reflect the honors experience in the first two years of the program. Topics covered will include common readings, discussion of current research topics or current events, and professional development of the student. Course can be repeated for up to 4 credits.','B100H',1,'Undergraduate')
,(87,9,'Biology of Marine Organisms','(Prerequisite: a grade of C or better in two of the three core courses: BIOL B301, B302, B303) Biological concepts emphasizing adaptation to marine environments. Laboratory experiments emphasize principles and techniques of marine biological study. Three lecture and three laboratory hours per week. Scheduled field trips are required.','B411',4,'Undergraduate')
,(88,33,'Black Americans','A survey of the historical development of black people in the Western Hemisphere.','B415',3,'Undergraduate')
,(89,49,'Bowling','An Introduction to the fundamentals of bowling, with an emphasis on basic techniques in all facets of the game, as well as an understanding of terminology.','B113',1,'Undergraduate')
,(90,26,'British Romantic Literature','Poetry and prose of the English Romantic period.','B411',3,'Undergraduate')
,(91,41,'Broadcast Design 1','Introduction to the design and production of media for documentary style broadcasting, including storyboarding, virtual sets, digital cinematography, video editing, and motion graphics.','B250',3,'Undergraduate')
,(92,41,'Broadcast Design 2','(Prerequisite: MART B250) Intermediate course on a specialized aspect of designing digital media for a documentary style television broadcast, such as virtual sets, digital cinematography, 3D motion graphics, or special effects.','B350',3,'Undergraduate')
,(93,58,'Business & Finance in Sport Management','(Prerequisite: HRTM B201 or consent of instructor) This comprehensive course focuses on methods and procedures as they apply to the economics of sport. Areas such as cost analysis, purchasing, budgeting and what a franchise means to a municipality will be examined.','B440',3,'Undergraduate')
,(94,54,'Business & Practice of Personal Training','(Prerequisite: Grade of B or better in PUBH B323) The continuation of PUBH B323, this practical course surveys the skills and knowledge required for success in the field of personal training. Following National Academy of Sports Medicine guidelines, the kinesiology and physiology of human performance and the effective development of a personal training enterprise are investigated.','B423',3,'Undergraduate')
,(95,8,'Business Communications','(Prerequisite: grade of C or better in ENGL B102) A study of effective methods of business communications including written, oral, electronic and organizational communication.','B345',3,'Undergraduate')
,(96,8,'Business Ethics','(Prerequisite: Junior standing) A study of the values and ethics in business, business and government relations, corporate social performance and stakeholder responsibility. Social, economic, political, technological and ecological dimensions of the external environment will be integrated.','B379',3,'Undergraduate')
,(97,8,'Business Finance','(Prerequisite: ACCT B226) The study of the procurement, management, and analysis of the financial wealth and resources of profit-seeking firms.','B363',3,'Undergraduate')
,(98,8,'Business Research Methods','(Prerequisites: STAT B201 and MKTG B350) Focus is on the acquisition, use and evaluation of information from a managers perspective. The course will include problem diagnosis, research design, questionnaire preparation, sampling plans and the collection, analysis and interpretation of data as an aid to effective and efficient managerial decisions.','B396',3,'Undergraduate')
,(99,57,'Business Spanish','(Prerequisite: Placement at 300 level on Phase II placement exam, grade of C or better in SPAN B301 or SPAN B302, or consent of instructor. Department consent required for transfer students.) Commercial organizations and business in Spanish-speaking countries, business correspondence, terminology and techniques in commercial transactions. Taught in Spanish.','B316',3,'Undergraduate')
,(100,42,'Calculus for Business Administration and Social Sciences','(Prerequisite: Qualification through placement or a grade of C or better in MATH B111 or consent) Derivatives and integrals of elementary algebraic, exponential and logarithmic functions. Maxima, minima, rate of change, and area under a curve. Applications include marginality and elasticity of demand. Offered every semester.','B122',3,'Undergraduate')
,(101,42,'Calculus I','(Prerequisite: Qualification through placement or a grade of C or better in MATH B115) Introduction to fundamental concepts and theorems of limits, continuity, and derivatives; rates of change; differentiation rules for algebraic and transcendental functions, including the chain rule; applications of derivatives; introduction to integration, including the Fundamental Theorem of Calculus and u-substitution; areas between curves. Offered every semester.','B141',4,'Undergraduate')
,(102,42,'Calculus II','(Prerequisite: Qualification through placement or a grade of C or better in MATH B141) Techniques of integration, applications of the integral, LHospitals Rule, improper integrals; sequences and series of real numbers, power and Taylor series, introduction to polar coordinates. Offered every semester.','B142',4,'Undergraduate')
,(103,42,'Calculus III','(Prerequisite: Qualification through placement or a grade of C or better in MATH B142) Parametric equations, polar coordinates, three dimensional analytic geometry, cylindrical and spherical coordinates, vector functions, functions of several variables, partial differentiation, max-min, Lagrange multipliers, multiple integrals and applications, integral vector calculus. Offered Spring semester.','B240',4,'Undergraduate')
,(104,24,'Capstone: Literacy Coaching Seminar','This course is the culmination of the M.Ed. program and focuses on bringing together all of the South Carolina Literacy Competencies for Reading Coaches (SCDE, 2015). Candidates discuss presentations by various literacy specialists and exemplary literacy coaches, evaluate a variety of literacy programs, materials, and assessments, and prepare a professional portfolio.','B650',3,'Graduate')
,(105,48,'Care of Adults with Acute and Chronic Conditions','(Prerequisite: NURS B202, B202C, B310 and B312) Nursing management of adult and older adult patients with acute and chronic conditions is introduced. Students will synthesize previous courses to link nursing concepts, physical examination and pharmacology as part of the care management plan. As disease processes by body system are examined in greater depth, students will study disease staging, complex therapeutics and technology usage, and anticipatory complications. Stigma, ethics, and discharge from one setting to another across the care continuum are presented as advanced challenges to intervention and outcome management.','B326',3,'Undergraduate')
,(106,48,'Care of Childbearing Families','(Prerequisite: NURS B320 and NURS B326; Corequisite: NURS B358) This course addresses the primary and preventive care provided to childbearing families. The needs of reproducing families to ensure safe pre-, intra-, and postnatal outcomes are addressed to ensure growth and functioning in the family unit. Male reproductive and female gynecological norms and abnormalities, along with complications of pregnancy, are contrasted. Psychosocial adaptations and special needs of the family unit are studied to manage grief and loss, palliative care and womens and mens reproductive health challenges.','B356',3,'Undergraduate')
,(107,48,'Care of Children','(Prerequisite: NURS B320 and NURS B326; Corequisite: NURS B356) The developmental, physiologic, cognitive, and health needs of children are presented. Children with acute and chronic health conditions, genetic abnormalities, and infectious diseases are studied with attention to how children respond to and adapt to disease and how disease prevention is addressed. Special attention is given to rapid and accurate assessment, availability of specialized health providers and equipment, and rapid transfer of pediatric patients during life-threatening emergencies.','B358',3,'Undergraduate')
,(108,48,'Care of Individuals with Mental and Addictive Disorders','(Prerequisite: NURS B320 and NURS B350; Pre or Co-requisite: NURS B360) This course focuses on the epidemiology and treatment of individuals with actue and chronic mental and addiction disorders across the lifespan. Bio-physical, genetic and environmental predisposition to these conditions are examined. Pharmacologic approaches are reviewed, with emphasis on maintaining drug therapy and alleviating side effects. Cognitive approaches to helping patients and families manage anxiety, fear, and self-doubt are addressed.','B412',3,'Undergraduate')
,(109,61,'Career and Life Planning','This course will aid in development of career and life-planning skills through exposure to self-assessment, occupational information, job search techniques, professional literature, experiential education, values clarification, and career ladder strategies.','B250',3,'Undergraduate')
,(110,43,'Careers in Business','(Prerequisite: Junior standing) An introduction to career opportunities and the career placement process in business.','B300',3,'Undergraduate')
,(111,35,'Careers in Hospitality/Tourism','(Prerequisite: Junior standing) Career options concurrent with the placement process.','B390',1,'Undergraduate')
,(112,35,'Catering Management','Management techniques, including planning, production and performance of off-premise catering.','B372',3,'Undergraduate')
,(113,9,'Cell and Molecular Biology','(Prerequisite: a grade of C or better BIOL B102) Principles of eukaryotic cell structure, molecular organization and physiology. Genome organization and expression. Cell growth, division and cell-cell interactions. Three lecture hours per week.','B302',3,'Undergraduate')
,(114,9,'Cell and Molecular Biology Laboratory','(Prerequisite or Co-requisite: BIOL B302) Experiments, exercises and demonstrations. Three lab hours per week','B302L',1,'Undergraduate')
,(115,6,'Ceramics I','(Prerequisite: ARTS B102, B103, B104, and B111) An introduction to the materials and techniques of ceramics focused on hand-building with an introduction to wheel throwing.','B220',3,'Undergraduate')
,(116,6,'Ceramics II','(Prerequisite: ARTS B102, B103, B104, B111, and B220) The execution of ceramic forms with a focus on wheel throwing, firing, and glazes. Additional emphases include design, critical evaluation of form, and advancement of technical skill.','B320',3,'Undergraduate')
,(117,6,'Ceramics III','(Prerequisite: ARTS B102, B103, B104, B111, and B320) The execution of ceramic forms with a concentration on hand-building techniques, and the formulation of glazes and clay bodies.','B321',3,'Undergraduate')
,(118,26,'Chaucer''s Work','Chaucers works, with special attention to the Canterbury Tales.','B401',3,'Undergraduate')
,(119,10,'Chemistry of Living Things','(Prerequisite: MATH B111 or higher.) Chemical principles including the structure of and energy associated with matter; quantitative kinetic and equilibrium analysis of chemical and physical processes. Structure and function of biological macromolecules and the molecular basis of inheritance are surveyed. Specifically designed for non-science majors. Cannot receive credit for both CHEM B101 and B109. Three lecture, one recitation and two laboratory hours per week.','B109',4,'Undergraduate')
,(120,54,'Chronic Disease and Risk Reduction','(Prerequisite: BIOL B243 and BIOL B244, or equivalent coursework) The study of those diseases of long duration and slow progression and the means by which their societal burden can be reduced.','B320',3,'Undergraduate')
,(121,26,'Cinema','{ENGL 472} (Prerequisite: ENGL B101 and ENGL B102) An investigation into the aesthetics of cinema. This course will also focus on the major genres.','B472',3,'Undergraduate')
,(122,60,'Cinema','{THEA B472} An investigation into the aesthetics of cinema. The course will also focus on the major genres.','B472',3,'Undergraduate')
,(123,26,'Cinema Laboratory','{ENGL B472L} Required viewing for THEA B472.','B472L',3,'Undergraduate')
,(124,60,'Cinema Laboratory','{THEA B472L} Required viewing for ENGL B472.','B472L',3,'Undergraduate')
,(125,18,'Cirriculum Planning, Development and Assessment in the Elementary School','(Prerequisite or Co-requisite: EDCI B100) This course explores issues involved in the development and education of children including curriculum, instruction, activities, materials, grouping, grading and appropriate methods of authentic assessment, as well as analysis of standardized test results in relation to the physical, social, emotional, and cognitive development of grade 2-6 learners for optimal learning. Parental involvement, community resources and collaborative relationships with specialists are included components of this course.','B320',3,'Undergraduate')
,(126,33,'Civil War and Reconstruction, 1860-1877','The political, military and social history of the War and the reorganization which followed.','B404',3,'Undergraduate')
,(127,12,'Classical Drama','{CPLT B395} Representative plays by Greek and Roman dramatists.','B395',3,'Undergraduate')
,(128,12,'Classical Drama','{ENGL B395} Representative plays by Greek and Roman dramatists.','B395',3,'Undergraduate')
,(129,48,'Clinical Care & Introduction to Nursing Techniques','(Co-requisites: NURS B202, B310, B312) This course emphasizes how to perform common nursing procedures. Techniques and skill development are practiced ensuring patient confidentiality, comfort measures and pain management, dietary restrictions/ intake and output measurement, infection control, vital signs, body mechanics/safety, concepts of self-care/hygiene, mobility and transfer, basic lab collection and interpretation of lab values commonly used in practice settings.','B202C',3,'Undergraduate')
,(130,48,'Clinical Care in Public and Community Health Settings','(Prerequisite: NURS B320, B326, and B350. Corequisite: NURS B412 and B418) In conjunction with NURS B412 and NURS B418, this clinical course focuses on experiential learning in community-based or public health settings. These settings serve primary and prevention care needs of school age, mental health, addictions, or other populations. A change management project that involves priority setting, delegation, policy making, budgeting, and/or measurement of community impact is introduced. Clinical experience may also include providing community-based education, care coordination, and managing resource capacity.','B422C',3,'Undergraduate')
,(131,48,'Clinical Care of Adults with Acute and Chronic Conditions','(Prerequisites: NURS B202, B202C, B312. Corequisite: NURS B320 & B326) Students will be exposed to adults and older adults with acute and chronic conditions. Clinical experiences will focus on the application of knowledge and skills related to the care of an adult patient. Emphasis will be placed on applying the nursing process to manage care, setting clinical priorities and using technology to anticipate patient needs as a member of interprofessional teams.','B326C',3,'Undergraduate')
,(132,48,'Clinical Care of Childbearing Families','(Prerequisite: NURS B320 and NURS B326; Corequisite: NURS B356 and NURS B358) In conjunction with NURS B358, this course blends practice/simulation laboratory experiences with clinical experiences in care settings where mothers, infants, children and family units receive care.','B360C',3,'Undergraduate')
,(133,48,'Clinical Care of High Acuity Adults & Elders','(Prerequisite: NURS B326, B326C, B412, B418 & B422C. Corequisite: NURS B425) Students will have exposure to adults and elders with high acuity needs. Clinical experiences will focus on the application of knowledge and skills related to the care of a high acuity adult or elder. Emphasis will be placed on application of the nursing process to manage care and reduce risks in this population, utilization of technology to monitor rapidly changing patient needs, plan and prioritize care, anticipate patient needs and contribute to interprofessional teams collaborating care for the high acuity adult or elder.','B425C',3,'Undergraduate')
,(134,16,'Clinical Observation & Analysis','Clinical experience in an early childhood setting. Observation and analysis in classroom setting includes focus on the following topics: learning climate, classroom management, lesson clarity, instructional variety, task orientation, leaning process, student success, performance outcomes and higher thought processes.','B100',3,'Undergraduate')
,(135,48,'Clinical Synthesis and Seminar','(Prerequisite: NURS B412, B418 and B422C) In this clinical course, students will have an opportunity to model program outcomes and strengthen their abilities to manage a client population throughout a shift, focusing on organizational, delegation, and time management skills. Priority setting and the ability to develop focus in delivering care to more than one client are emphasized. In the seminar setting, synthesis of clinical information linked to individuals, families, and communities will be reviewed. Role understanding and clinical functioning will be evaluated to meet entry-level practice expectations. Knowledge of patient education, discharge planning, team functions, and nursing skills will be demonstrated.','B430C',3,'Undergraduate')
,(136,35,'Club Cuisine and Service','(Prerequisite: HRTM B370 or B372) Advanced topics in the management of production and service techniques for private clubs.','B473',3,'Undergraduate')
,(137,35,'Club Management','Unique problems and issues associated with private club management.','B385',3,'Undergraduate')
,(138,35,'Club Management Internship','(Prerequisite: HRTM B285) Placement with a private club for a controlled learning experience. Minimum requirement of 400 work hours.','B491',3,'Undergraduate')
,(139,46,'Coastal Environments of the Southeastern','Coastal zones of South Carolina and neighboring states, including geologic history, geomorphology, stratigraphy, hydrogeology, shoreline processes, environmental issues and effect of man. Three lecture hours each week plus optional field trips. Not available for marine science major credit.','B215',3,'Undergraduate')
,(140,46,'Coastal Environments of the Southeastern U.S. Laboratory','Exercises examining coastal ecology, geomorphology, hydrogeology, shoreline processes, environmental issues and human impact. Two laboratory hours per week. Scheduled field trips required. Not available for marine science major credit.','B215L',1,'Undergraduate')
,(141,53,'Cognitive Psychology','(Prerequisite: PSYC B302) Research and theories on sensory memory, attention, short-term and working memory, human learning and forgetting, imagery, long-term memory, speech perception, reading, language, thinking and problem solving and decision making.','B401',3,'Undergraduate')
,(142,56,'Collective Behavior','An analysis of crowds, publics, social movements and the mass society in terms of their institutional and social psychological consequences.','B354',3,'Undergraduate')
,(143,42,'College Algebra','(Prerequisite: qualification through placement) Basic college algebra; linear and quadratic equations, inequalities, functions and graphs of functions, exponential and logarithmic functions, systems of equations. Credit may not be received for both MATH B111 and B111L. Offered every semester.','B111',3,'Undergraduate')
,(144,8,'Commercial Law','(Prerequisite: Junior standing) Contracts, sales, bailments, negotiable instruments, agency, partnership and corporation. A combination of textbook and casebook methods of instruction is used.','B324',3,'Undergraduate')
,(145,11,'Communication and Popular Culture','(Prerequisite: Junior standing) Explores the complex relationships of language, visual images, mediated communication, and cultural values in popular culture.','B400',3,'Undergraduate')
,(146,11,'Communication in Sports','Examines sports from a communication studies perspective.','B342',3,'Undergraduate')
,(147,11,'Communication Law','(Prerequisite: COMM B190 and COMM B240, or consent of instructor) An overview of the key areas of First Amendment law, and the important U.S. Supreme Court cases that have addressed the Constitution''s guarantee of free speech and free press.','B303',3,'Undergraduate')
,(148,11,'Communication Studies Capstone','(Prerequisite: Senior status and consent of instructor) Provides students with the opportunities to integrate the knowledge and skills they have acquired as communication studies majors as well as provide experiences for students to exhibit competent communication skills learned during their program of study.','B490',3,'Undergraduate')
,(149,11,'Communication Studies Research','An examination of the qualitative and quantitative methods employed in communication research. Includes oral presentation.','B255',3,'Undergraduate')
,(150,48,'Community and Public Health Nursing','(Prerequisite: NURS B356 and NURS B358 for pre-licensure students; NURS B350 for all nursing students; Co-requisite) Primary prevention strategies for populations at risk are emphasized to promote and protect health and prevent disease across the life span. Local, state and national health policies, political and economic influences will be part of the analysis of community issues and activities. An inter-disciplinary, collaborative approach is taken in community assessment, decision-making, planning, implementation and evaluation throughout community health nursing practice. The role and functions of agencies that deliver public health, community-based is presented. These functions include communicable disease reporting, control and management, environmental monitoring, disaster preparedness and management, the care of vulnerable populations, and public education. Community assessment and agency coordination at the local, regional, and national level is discussed. Principles of epidemiology, surveillance, environmental influences on health, strategies for dealing with public health issues will be presented in caring for populations. The place for community based and public health nursing as part of a coordinated/dis-coordinated care system at the local, regional, and national level will be examined. National and state agencies such as the CDC, DHEC and American Red Cross will serve as exemplars for the care coordination.','B418',3,'Undergraduate')
,(151,56,'Community Organization','An analysis of formal and informal organization, the interrelationships among public and private agencies and means through which community action programs are initiated, coordinated and maintained.','B308',3,'Undergraduate')
,(152,53,'Community Psychology','(Prerequisite: PSYC B101) Community psychology explores the roles that individuals play in the formation, resilience, and well-being of communities and, in turn, examine how communities influence the individual.','B415',3,'Undergraduate')
,(153,55,'Comparative Religion','The religious experience of varied persons and groups, East and West, in traditional and contemporary settings. (Satisfies USCB General Education Global Citizenship and Multicultural Understanding Requirement).','B203',3,'Undergraduate')
,(154,42,'Complex Analysis','(Prerequisite: grade of C or better in MATH B240) Complex integration, calculus of residues, conformal mapping, Taylor and Laurent series expansions, applications.','B452',3,'Undergraduate')
,(155,26,'Composition and Literature','(Prerequisite: ENGL B101 or B105, each with a grade of C or higher) An extension of composition skills developed in ENGL B101 and an introduction to literature, emphasizing the interpretive skills and processes necessary to read complex and imaginative texts creatively, critically, and rhetorically so students can write responses to - and interventions in - the world around them.','B102',3,'Undergraduate')
,(156,26,'Composition and Rhetoric','An introduction to university-level writing, emphasizing the rhetorical approaches necessary to understand other writers'' purposes and stances, create effective writing, and develop processed for composing texts for academic, civic, professional, and personal purposes.','B101',3,'Undergraduate')
,(157,13,'Computational Mathematics','{CSCI B280, MATH B280} (Prerequisite: MATH B142 and CSCI B104 or consent of instructor) Fundamental concepts selected from linear algebra and differential equations applicable to Computational Science. Major topics include systems of linear equations, diagonalization, and numerical solutions to differential equations. The focus is on computational methods and programming skills that will be implemented in a variety of science and engineering disciplines.','B280',4,'Undergraduate')
,(158,38,'Computational Mathematics','{CSCI B280} (Prerequisite: MATH B142 and CSCI B104 or consent of instructor) Fundamental concepts selected from linear algebra and differential equations applicable to Computational Science. Major topics include systems of linear equations, diagonalization, and numerical solutions to differential equations. The focus is on computational methods and programming skills that will be implemented in a variety of science and engineering disciplines.','B280',3,'Undergraduate')
,(159,13,'Computational Mathematics','{MATH B280} (Prerequisite: MATH B142 and CSCI B104 or consent of instructor) Fundamental concepts selected from linear algebra and differential equations applicable to Computational Science. Major topics include systems of linear equations, diagonalization, and numerical solutions to differential equations. The focus is on computational methods and programming skills that will be implemented in a variety of science and engineering disciplines.','B280',4,'Undergraduate')
,(160,13,'Computational Science Co-op/Internship','{ISAT B499} (Prerequisite: Computational Science major or consent of instructor) Practical full-time work experience in an area of Computational Science, selected by the student and approved by the Department Chair or Computational Science Program Coordinator. For 1 credit, 45 minimum internship work hours required; for 2 credits, 90 work hours, and for 3 credits, 135 work hours.','B499',3,'Undergraduate')
,(161,13,'Computer Game Development','(Prerequisite: CSCI B350 or consent.) Game concept development; User interface design; Graphics (2D, 3D, animation, and advanced techniques); Game physics; Real-time interaction; Intelligent characters; Software engineering considerations.','B452',3,'Undergraduate')
,(162,13,'Computer Graphics','{CSCI B365} (Prerequisite: CSCI B240 and CSCI/MATH B280 [or MATH B230] or consent.) Graphics pipeline; 2D and 3D geometric objects and transformations; 2D and 3D viewing, clipping, lighting, and rendering processes; Perspective projections; Lighting and reflectance models; Shading models; Hidden surface elimination; 3D curves and surfaces; Color perception and color models.','B365',3,'Undergraduate')
,(163,38,'Computer Graphics','{ISAT B365} (Prerequisite: CSCI B240 and CSCI/MATH B280 [or MATH B230] or consent.) Graphics pipeline; 2D and 3D geometric objects and transformations; 2D and 3D viewing, clipping, lighting, and rendering processes; Perspective projections; Lighting and reflectance models; Shading models; Hidden surface elimination; 3D curves and surfaces; Color perception and color models.','B365',3,'Undergraduate')
,(164,44,'Computer Information Systems in Business','Concepts and techniques of business problem solving using microcomputers. Introduction to the PC operating environment, basic information system concepts and spreadsheet, presentation, database and word processing software.','B290',3,'Undergraduate')
,(165,38,'Computer Programming Techniques, Practices, and Tools','{CSCI B104} (Prerequisites: Two years of college preparatory mathematics or equivalent) Students successfully completing this course will have developed basic competence in computer programming techniques, practices, and tools. Topics include: coding standards and best practices; implicit and explicit types; conditional/complex-conditional logic; iteration; logic encapsulation and code modularity; parameter/argument usage; file input and output; Integrated Development Environment (IDE) usage; computer program creation. Previous programming experience is not required.','B104',3,'Undergraduate')
,(166,13,'Computer Programming Techniques, Practices, and Tools','{ISAT B104} (Prerequisites: Two years of college preparatory mathematics or equivalent) Students successfully completing this course will have developed basic competence in computer programming techniques, practices, and tools. Topics include: coding standards and best practices; implicit and explicit types; conditional/complex-conditional logic; iteration; logic encapsulation and code modularity; parameter/argument usage; file input and output; Integrated Development Environment (IDE) usage; computer program creation. Previous programming experience is not required.','B104',3,'Undergraduate')
,(167,38,'Computer Science Co-Op/Internship','{CSCI B499} (Prerequisite: Computational Science major or consent of instructor) Practical full-time work experience in an area of Computational Science, selected by the student and approved by the Department Chair or Computational Science Program Coordinator. For 1 credit, 45 minimum internship work hours required; for 2 credits, 90 work hours, and for 3 credits, 135 work hours.','B499',1,'Undergraduate')
,(168,38,'Computer System Administration','{CSCI B207} (Prerequisite: CSCI B145 and B150) Account maintenance, backups, restoration, system configuration, resource allocation and monitoring, network management, peripheral administration, emphasis on Microsoft Windows and UNIX/Linux systems.','B207',3,'Undergraduate')
,(169,13,'Computer System Administration','{ISAT B207} (Prerequisite: CSCI B145 and B150) Account maintenance, backups, restoration, system configuration, resource allocation and monitoring, network management, peripheral administration, emphasis on Microsoft Windows and UNIX/Linux systems.','B207',3,'Undergraduate')
,(170,48,'Concepts, Communications, and Calculations','This course introduces concepts essential to basic nursing practice. Nursing''s historical evolution as a profession through theory, concept and role development will be presented. An overview of medical terminology and medical calculations is provided as skills that promote patient safety within the health disciplines. Written communication skills for the professional nurse will be presented. Students will be introduced to the difference between scholarly and non-scholarly sources.','B105',3,'Undergraduate')
,(171,35,'Conference and Meeting Planning','(Prerequisite: HRTM B260) Planning and managing conferences and meetings in the tourism industry.','B364',3,'Undergraduate')
,(172,9,'Conservation Biology','(Prerequisite: a grade of C or better in two of the three core courses: BIOL B301, B302, B303) Synthesis of current scientific trends in conservation biology. Emphasis will be placed on the preservation of biological diversity as well as its evolutionary potential. Laboratory/Seminar will review scientific literature and introduce modern molecular techniques in conservation biology and computer simulation modeling.','B471',4,'Undergraduate')
,(173,45,'Consumer Behavior','(Prerequisite: MKTG B350) The principal objective of study is the consumer decision process as examined in a marketing context. Selected concepts from psychology, sociology, anthropology and behavioral disciplines are analyzed to develop the student''s ability to understand and predict reactions of consumers to marketing decisions.','B455',3,'Undergraduate')
,(174,15,'Consumer Economics','This introductory survey course provides students with an understanding of the basic elements of consumer economics and personal finance. The course is designed to assist students in becoming informed, rational, decision-makers. Topics include planning and budgeting, credit, consumer rights, consumers and markets, marginal analysis and taxes.','B101',3,'Undergraduate')
,(175,26,'Contemporary American Literature','Poetry and prose from 1945 to present.','B426',3,'Undergraduate')
,(176,8,'Contemporary Business','The nature of American business and its goals. The course includes types of economic systems and concepts of organizing and managing businesses. Topics in management, marketing, finance and accounting will be integrated into the course. A topical survey of business issues and challenges.','B101',3,'Undergraduate')
,(177,3,'Contemporary Cross-Cultural Analysis','An examination of conformity, conflict or stability, of human interactions across cultural boundaries both at home and abroad, the positive and negative consequences of increasing global interconnectedness and the role of culture change, ethnic identity or religious unity in creating contradictory social and political trends. (Satisfies USCB General Education Global Citizenship and Multicultural Understanding Requirement).','B312',3,'Undergraduate')
,(178,33,'Contemporary Europe From World War I to World War II','The Great War, revolution and reconstruction; the rise of authoritarian and totalitarian regimes and the coming of World War II.','B317',3,'Undergraduate')
,(179,50,'Contemporary Moral Issues','Moral issues confronting men and women in contemporary society. Topics will vary but may include discussion of problems related to abortion, drugs, euthanasia, war, social engineering and punishment of criminals.','B211',3,'Undergraduate')
,(180,24,'Content Area Literacy for Early Childhood and Elementary Teachers','(Prerequisite: Admission to the Professional Program or special permission of the Department Chair and EDCI B100, EDCI B243, and EDRD B318) This course is designed to instruct teacher candidates, grades pre-K through 6, in developing methods and materials that will improve their students literacy skills in content area reading and writing. Offered in Fall.','B428',3,'Undergraduate')
,(181,24,'Content Area Reading and Writing','After gaining a sound theoretical knowledge of the reading and writing processes in nonfiction text, teachers will apply what they have learned to their own disciplines, creating strategies that will support students in reading and writing within the context of content area instruction.','B629',3,'Graduate')
,(182,24,'Content Literacy for Secondary Teachers','(Prerequisite: EDCI B100; admissions to a secondary teaching program, or special permission of the Department Chair of Education) This course provides 7-12 teachers with the strategies for teaching literacy within the framework of content area classes. The course teaches a sound theoretical knowledge of academic vocabulary, nonfiction texts structures and strategies for analyzing texts to improve the knowledge base.','B429',3,'Undergraduate')
,(183,52,'Contoversies in American Politics','An introduction to the analysis of key issues in contemporary American politics focusing on the arguments, the groups involved and the political factors that influence the outcome of the debate.','B111',3,'Undergraduate')
,(184,35,'Contract Foodservice Management','Issues related to the management of contract foodservice accounts.','B376',3,'Undergraduate')
,(185,26,'Copyediting and Document Design','(Prerequisite: ENGL B102, with a grade of ''C'' or higher) This course gives students an overview of the skills necessary to prepare texts (in a range of media) for publication: copyediting and document design. Students will learn to design texts for greater readability, and to complete document reviews including grammar/style, copyediting notations, and fact-checking. Appropriate for students from any discipline.','B250',3,'Undergraduate')
,(186,1,'Cost Accounting','(Prerequisite: Grade of C or higher in ACCT B226) Preparation, critical analysis and use of management accounting information for purposes of strategic decision making, planning and control and performance measurement and evaluation.','B355',3,'Undergraduate')
,(187,26,'Creative Writing Across the Curriculum','(Prerequisite: ENGL B101 or B105, and ENGL B102 or B106, each with a C or higher.) Introductory level workshop designed to foster a students appreciation for, and ability to create brief works of adult level fiction, poetry, nonfiction, and drama. Appropriate for students from any discipline.','B222',3,'Undergraduate')
,(188,50,'Critical Social Theories','This course is an introduction to the critical social theories that have developed since the late 19th century. Critical social thought in philosophy focuses on various socio-historical conditions in contemporary society, as well as on the sociocultural methods that are used to study them. Possible frameworks may include Marxism, Neo-Marxism, feminist philosophies, queer theory, critical race theory, and post-analytic philosophy. Social and cultural topics may include race, gender, global economic dynamics, Internet culture, and social media.','B303',3,'Undergraduate')
,(189,35,'Cruise Line Management','An overview of the cruise line industry, its organization, impacts upon ports of call and destinations, and the skills needed to begin a productive career in this specialized travel.','B301',3,'Undergraduate')
,(190,38,'Cryptography','(Prerequisite: CSCI/ISAT B201, CSCI/ISAT B416, MATH B141, STAT B201 or B240 or B340, or consent of instructor.) Cryptography, secure encryption protocols, and the essential mathematics underlying encryption. Number theory, symmetric and asymmetric ciphers, hash functions, key management and distribution. Transport-level security and other forms of network and Internet security.','B455',3,'Undergraduate')
,(191,16,'Cultural Diversity in Education','This course prepares students to demonstrate an understanding of the depth and breadth of cultural diversity within the United States, as well as the ways that the intersections of cultures within the classroom shape teaching and learning outcomes.','B322',3,'Undergraduate')
,(192,36,'Cultural Historiography','(Prerequisite: Students must be classified as a junior or senior.) Intensive interdisciplinary study of selected topics regarding cultural history with empirical research component. Open to all majors. Can be repeated up to two times (6 credit hours). Topic reflected in section number. Maymester only.','B330',3,'Undergraduate')
,(193,53,'Cultural Psychology','(Prerequisite: PSYC B101) A global cultural perspective on human behavior exploring how culture influences our lives and the lives of others across the world. Topics may include cultural influences on development, mental health, cognition, personality and social behavior.','B380',3,'Undergraduate')
,(194,17,'Curriculum Planning and Development in Early Childhood Education','(Prerequisite or Co-requisites: EDCI B100; EDEC B340; EDPY B335). This curriculum course is designed for prospective teachers in the nursery, kindergarten and primary schools. The course explores various issues involved in the development and education of children from the ages of four to eight. Attention is given to learning activities, materials and equipment suitable for teaching at this level. Emphasis is given to appropriate methods for assessment of children ages four through eight and to the relationship of various subject areas to the physical, social, emotional and cognitive development of the child. Philosophy, history of early childhood education, classroom management, societal influences, parental involvement and community resources are included.','B342',3,'Undergraduate')
,(195,16,'Curriculum Planning, Technology, and Assessment in Secondary Education','(Prerequisite or Corequisite: EDCI B100) Explores issues of development and education of adolescents including curriculum, instruction, activities, materials, and authentic assessment. Prospective teachers will understand the importance of differentiation and technology integration at all levels of instruction and assessment. Parental involvement, community resources, and collaborative relationships with specialists are included components of this course.','B320',3,'Undergraduate')
,(196,13,'Data Communications and Networks','(Prerequisite: undergraduate programming experience or CSCI B500 or consent of instructor) Advanced topics in data communications, architecture, communication protocols, topologies, network access control, LANs, MANs, and WANs; internetworking.','B516',3,'Graduate')
,(197,13,'Data Management and Analytics','(Prerequisite: CSCI B520 [or demonstrated equivalent knowledge/experience] or consent of instructor) Foundations of data analytics. Concepts and skills for relational data modeling, querying, and management.','B622',3,'Graduate')
,(198,13,'Data Mining','(Prerequisite: CSCI B501 and CSCI B502 [or demonstrated equivalent knowledge/experience]) Concepts, issues, tasks and techniques of data mining. Topics include data preparation, feature abstraction, association, classification, clustering, evaluation and validation, scalability, spatial and sequence mining, and data mining applications.','B522',3,'Graduate')
,(199,13,'Data Visualization','(Corequisite: CSCI B501 and CSCI B502 or consent of instructor) Advanced techniques and algorithms for creating effective visualizations based on principles from graphic design, visual art, perceptual psychology, and cognitive science.','B566',3,'Graduate')
,(200,13,'Data Visualization','(Prerequisite: CSCI B350 and CSCI B365 or consent) Concepts of visualization and human vision system; hardware and software basics of computer graphics; visualization pipeline; data representation and processing in computer graphics; algorithms in rendering 2D and 3D geometry; image processing; applications of visualization in science and technology.','B466',3,'Undergraduate')
,(201,38,'Database Management Systems I','{CSCI B320} (Prerequisite: CSCI B145 or consent) Provides foundations of database systems for students with little prior database experience; topics include relational algebra, data models, schema design and normalization, storage management, query, transaction, concurrency control and consistency.','B320',3,'Undergraduate')
,(202,38,'Database Management Systems II','{CSCI B420} (Prerequisite: CSCI B320) This course explores advanced data manipulation and server-side programming techniques for use in enterprise Relational Database Management Systems (RDBMS). Topics include: platform specific programmatic extensions to Structured Query Language (SQL); stored procedure, function, and package implementation; trigger creation and usage; query optimization techniques; security considerations.','B420',3,'Undergraduate')
,(203,13,'Database Management Systems II','{ISAT B420} (Prerequisite: CSCI B320) This course explores advanced data manipulation and server-side programming techniques for use in enterprise Relational Database Management Systems (RDBMS). Topics include: platform specific programmatic extensions to Structured Query Language (SQL); stored procedure, function, and package implementation; trigger creation and usage; query optimization techniques; security considerations.','B420',3,'Undergraduate')
,(204,13,'Database Systems Management','{ISAT B320} (Prerequisite: CSCI B145 or consent) Provides foundations of database systems for students with little prior database experience; topics include relational algebra, data models, schema design and normalization, storage management, query, transaction, concurrency control and consistency.','B320',3,'Undergraduate')
,(205,13,'Database-Driven Applications Development','{CSCI B321} (Prerequisite: CSCI B145 and CSCI B320) Development of data-driven software for devices including smart phones, tablets, handheld units, and other general purpose computing platforms. Emphasis on database connectivity, design patterns, human-computer interfaces and usability.','B321',3,'Undergraduate')
,(206,38,'Database-Driven Applications Development','{ISAT B321} (Prerequisite: CSCI B145 and CSCI B320) Development of data-driven software for devices including smart phones, tablets, handheld units, and other general purpose computing platforms. Emphasis on database connectivity, design patterns, human-computer interfaces and usability.','B321',3,'Undergraduate')
,(207,48,'Decision-Making in Concept Based Care','(For the pre-licensure track: Prerequisite: Acceptance as a pre-licensure BSN student; Co-requisite: NURS B310 and NURS B312) The nursing process as a problem-solving framework is introduced to identify, treat, evaluate and document clinical problems in health records. Emphasis is placed on patient and family-centered therapeutic communication as an adjunct to assessment and evaluation. Selected universal concepts reflecting the holistic nature of caregiving across settings are presented to advance critical thinking.','B202',3,'Undergraduate')
,(208,33,'Decolonization: Colonialism and Revolution in Africa and Asia','A study of the demise of European colonial empires in the nineteenth and twentieth centuries. Emphasis will be placed on the rise of nationalism among subject peoples in Africa and Asia.','B353',3,'Undergraduate')
,(209,7,'Desciptive Astronomy II','(Prerequisite: Grade of C or better in MATH B111 or a higher level mathematics course) Study of Galactic Astronomy including stars, black holes and Galaxies.','B211',3,'Undergraduate')
,(210,7,'Descriptive Astronomy I','(Prerequisite: Grade of C or better in MATH B111 or a higher level mathematics course) The universe: physical processes and methods of study. Lectures, demonstrations, and laboratory experience. Designed primarily for the non-science major.','B111',3,'Undergraduate')
,(211,7,'Descriptive Astronomy I Laboratory','Selected topics from ASTR B111 studied in greater depth. Laboratory experience required of students who have not completed ASTR B111.','B111L',1,'Undergraduate')
,(212,7,'Descriptive Astronomy II Laboratory','(Prerequisite or Co-requisite: ASTR B111L) Topics from ASTR B111/B211 studied in greater depth. Laboratory experience required of students who have not completed ASTR B111.','B211L',1,'Undergraduate')
,(213,14,'Design of Mechanical Elements','(Prerequisite: CSXE B260.) Design against static failure and fatigue failure of structural members and machine parts; design and selection of components including fasteners, welds, shafts, springs, gears, bearings, and chain drives.','B327',3,'Undergraduate')
,(214,35,'Destination Marketing','The application of marketing management and best practices to Hospitality destination development. Also examined will be the structures of destination marketing organizations, funding sources, and operations.','B235',3,'Undergraduate')
,(215,40,'Development of the English Language','{ENGL B453} English from Indo-European through Germanic and into Old English, Middle English and Modern English. No previous knowledge of Old English or Middle English is required.','B431',3,'Undergraduate')
,(216,9,'Developmental Biology I','(Prerequisite: a grade of C or better in two of the three core courses: BIOL B301, B302, B303) An introduction to the fundamental principles of animal and plant embryonic and post-embryonic development using anatomical, experimental and molecular genetics approaches. Three lecture hours per week.','B405',3,'Undergraduate')
,(217,9,'Developmental Biology I Laboratory','(Co-requisite: BIOL B405) Descriptive and experimental exercises related to embryology. One three-hour laboratory per week.','B405L',1,'Undergraduate')
,(218,24,'Differentiation in Reading Instruction','This course requires that students conduct in-depth study of effective literacy methods, materials, and formative assessment for K-12 classrooms. Emphasis is on serving the instructional needs of diverse students, including the gifted and talented, culturally and linguistically diverse learners, and children and young people with disabilities.','B623',3,'Graduate')
,(219,41,'Digital Animation 1','Introduction to the theory and practice of using computer software to create animated digital media, including 3D character animation.','B210',3,'Undergraduate')
,(220,41,'Digital Animation 2','(Prerequisite: MART B210) Intermediate project-based course on a specialized aspect of digital animation production, including 3D modeling, character animation, or special effects.','B310',3,'Undergraduate')
,(221,11,'Digital Communication Technologies','(Prerequisite: COMM B140 or B201) This course introduces students to digital communication technologies from both a theoretical and practical framework. Students will understand how to use communication technologies to advance communication strategies to multiple audiences.','B216',3,'Undergraduate')
,(222,41,'Digital Fabrication','(Prerequisite: MART B145 or permission of instructor) An introduction to emerging technologies relating to rapid prototyping processes, this course focuses on three-dimensional printing and other computer controlled technologies pertaining to the design and fabrication of a sculptural object and/or design.','B375',3,'Undergraduate')
,(223,13,'Digital Image Processing','(Prerequisite: CSCI B500, B501, and B502 [or demonstrated equivalent knowledge/experience]) Computational techniques in image processing and analysis.','B563',3,'Graduate')
,(224,41,'Digital Imaging','(Prerequisite: MART B102 or permission of instructor.) Foundations class on the aesthetic and communicative elements of digital image production, including 2D computer graphics, 3D motion graphics, and coding for media designers.','B145',3,'Undergraduate')
,(225,38,'Digital Logic Design','{CSCI B211} (Prerequisite: MATH B141 or B174) Number systems, Boolean algebra, logic design, sequential machines.','B211',3,'Undergraduate')
,(226,13,'Digital Logic Design','{ISAT B211} (Prerequisite: MATH B141 or B174) Number systems, Boolean algebra, logic design, sequential machines.','B211',3,'Undergraduate')
,(227,6,'Digital Photography I','(Prerequisite: ARTS B102, B103, B104, and B111) An introduction to the use of the DSLR camera and software manipulation. Manual camera use and creative expression will be the focus aside from historical references pertaining to traditional and digital photography.','B262',3,'Undergraduate')
,(228,6,'Digital Photography II','(Prerequisite: ARTS B102, B103, B104, B111, and B262) Building on the foundation of ARTS B262, the photographic image is further explored in the form of time-based and alternative concepts of photography.','B363',3,'Undergraduate')
,(229,6,'Digital Photography III','(Prerequisite: ARTS B102, B103, B104, B111, and B363) A more experimental approach to the photographic image. Non-traditional processes and concepts will be explored, with the further development of personal expression related to the image.','B364',3,'Undergraduate')
,(230,9,'Directed Studies in Biology','(Prerequisite: BIOL B101) Study of a topic not otherwise available to student. May involve reading assignments, tutorial, lectures, papers, presentations, or field or laboratory study, determined in consultation with instructor. Repeatable to a maximum of 6 credits.','B295',1,'Undergraduate')
,(231,6,'Directed Studio Art Internship','(Prerequisites: minimum 2.5 GPA, 24 hours of ARTS credits, and approved contract with the internship supervisor) Supervised professional experience working within an arts business. A contract approved by the instructor, advisor and department chair is required for undergraduate students. Minimum of 150 service hours required.','B390',3,'Undergraduate')
,(232,60,'Directing','(Prerequisite: THEA B170). An introduction to the history, principles, and practices of the art of stage direction including the selection, casting, and rehearsing of scenes to be presented in class.','B333',3,'Undergraduate')
,(233,42,'Discrete Mathematics for Computer Science','(Prerequisite: Qualification through placement or a grade of C or better in MATH B115) Induction, complexity, elementary counting, combinations and permutations, recursion and recurrence relations, graphs and trees; discussion of the design and analysis of algorithms with emphasis on sorting and searching. Offered Spring semester.','B174',3,'Undergraduate')
,(234,11,'Documentary Production','(Prerequisite: COMM B225 or instructor permission) A course devoted to the study of techniques of producing documentaries on video. The work will be grounded in an historical survey of the genre in film and television. The class will include single camera production projects by class production teams.','B403',3,'Undergraduate')
,(235,11,'Documentary Theory & Aesthetics','The course is a theoretical consideration of documentary filmmaking, covering the subgenres, conventions, evolution, social impact, and contemporary issues of the genre. Students will watch and critique films that represent a variety of approaches to the genre.','B307',3,'Undergraduate')
,(236,6,'Drawing I','Introduction to the materials and basic techniques of drawing.','B111',3,'Undergraduate')
,(237,6,'Drawing II','(Prerequisite: ARTS B102, B103, B104, and B111) This course offers further development of skills in observation; composition, drawing techniques, and language to students who have completed ARTS B111 or equivalent.','B212',3,'Undergraduate')
,(238,6,'Drawing III','(Prerequisite: ARTS B102, B103, B104, B111, and B212) Enhancing graphic richness in drawings with intellectual and visual perception as content.','B330',3,'Undergraduate')
,(239,14,'Dynamics','(Prerequisite: CSXE B200.) Kinematics of particles and rigid bodies. Kinetics of particles, emphasis on Newtons second law: energy and momentum methods for the solution of problems. Applications of plane motion of rigid bodies.','B310',3,'Undergraduate')
,(240,26,'Early Shakespeare','Shakespeares early poetry and plays, with representative works by his contemporaries.','B405',3,'Undergraduate')
,(241,9,'Ecology and Evolution','(Prerequisite: a grade of C or better in BIOL B102 and Co-requisite: BIOL B301L) Concepts of evolution, populations and population interactions; communities and ecosystems. Three lecture hours per week.','B301',3,'Undergraduate')
,(242,9,'Ecology and Evolution Laboratory','(Prerequisite or Co-requisite: BIOL B301) Experiments, exercises and demonstrations. Three hours per week.','B301L',1,'Undergraduate')
,(243,56,'Ecology of Human Social Systems','Relationships among and changes in populations, social organization, technology and the environment.','B311',3,'Undergraduate')
,(244,26,'Editing and Publishing Practicum','(Prerequisite: ENGL B102 and at least one 200-level ENGL course, which may be taken concurrently. Consent of instructor.)English 211 provides students with practical experience in editing and publishing through their work on the critical journal or literary magazine; may be taken up to 6 times for credit. Appropriate for students from any discipline.','B211',1,'Undergraduate')
,(245,17,'Education of the Young Child','(Prerequisite or Co-requisite: EDCI B100). A study of the physical, emotional, intellectual and social components of development, birth through age eight and their relationship to the education of the young child birth - age eight. Diagnosis and assessment of development are addressed. Programs serving young children and their families will be discussed. The administration of these programs as well as advocacy efforts are included. Observation and participation in early childhood settings is required.','B340',3,'Undergraduate')
,(246,25,'Educational Research, Design, and Analysis','This course provides an overview of the principles, models, and techniques of educational research. A substantial portion of this course focuses on the acquisition of critical reading skills and on the analysis and interpretation of data produced by educational investigation and inquiry.','B620',3,'Graduate')
,(247,42,'Elementary Differential Equations','(Prerequisite: Qualification through placement or a grade of C or better in MATH B142) Ordinary differential equations of first order, higher order linear equations, Laplace transform methods, series methods; numerical solution of differential equations. Applications to physical sciences and engineering. Offered Spring semester.','B242',3,'Undergraduate')
,(248,59,'Elementary Statistics','(Prerequisite: MATH B101 or higher or consent of instructor) An introductory course in the fundamentals of modern statistical methods. Topics include descriptive statistics, normal distributions, random sampling, statistical studies and ethics, probability, confidence intervals, tests of hypothesis, simple linear regression and correlation.','B201',3,'Undergraduate')
,(249,56,'Elementary Statistics for Sociologists','An introduction to concepts and application of quantitative methods, including descriptive and inferential statistics. Emphasis on analysis of empirical sociological data.','B220',3,'Undergraduate');
INSERT INTO Courses([CoursesID],[SubjectsID],[CourseTitle],[CourseDescription],[CourseNumber],[CreditHours],[Levels]) VALUES
 (250,59,'Elementary Statistics II','(Prerequisite: STAT B201 or consent of instructor) A second course in statistics for students requiring knowledge of advanced procedures for descriptive and inferential statistics. Topics include assessing normality, modeling nonlinear data, conditions and assumptions for inference, and application of multiple inference techniques. Other topics chosen from: statistical quality control, random variables, binomial and geometric distributions, sampling and simulation, and non-parametric tests.','B210',3,'Undergraduate')
,(251,59,'Elementary Statistics Laboratory','(Prerequisite: or Co-requisite: STAT B201) Experiments which illustrate important concepts of elementary statistics. Two laboratory hours per week.','B202',3,'Undergraduate')
,(252,41,'Emerging Technologies','(Prerequisite: MART B145 or permission by instructor) This course focuses on the use of hardware and software to create artwork that has elements of interactivity, time-based functionality and code manipulation. Other topics include: DIY movements, microprocessors, and installation art.','B385',3,'Undergraduate')
,(253,14,'Engineering Graphics and Visualization','(Prerequisite: PHYS B211 or consent of instructor) Principles and practice of visualization and graphical representation using modern computer-aided design tools.','B211',3,'Undergraduate')
,(254,26,'English Capstone','(Prerequisite: English or English Education major; Department approval; Must be taken during last semester of coursework) Students analytical reflection and writing about their program through the creation of a digital portfolio.','B491',1,'Undergraduate')
,(255,26,'English Literatures from the 18th Century','(Prerequisite: ENGL B101 or B105, and ENGL B102 or B106, each with a C or higher.) British and postcolonial poetry, drama and prose from the 18th Century to the present. Appropriate for students from any discipline.','B289',3,'Undergraduate')
,(256,26,'English Literatures to the 18th Century','(Prerequisite: ENGL B101 or B105, and ENGL B102 or B106, each with a C or higher.) Early British poetry, drama, and prose to the 18th Century. Appropriate for students from any discipline.','B288',3,'Undergraduate')
,(257,26,'Enhanced Composition','English majors, humanities majors, and all word-lovers: an enhanced version of ENGL B101. An introduction to genres of writing, including (but not limited to) researched arguments.','B105',3,'Undergraduate')
,(258,26,'Enhanced Composition and Literature','(Prerequisite: ENGL B101 or B105, each with a grade of C or higher) For English majors, humanities majors, and all word-lovers: an enhanced version of ENGL B102. An introduction to literary interpretation and the writing of researched arguments about literature.','B106',3,'Undergraduate')
,(259,8,'Entrepreneurship','(Prerequisites: MKTG B350, BADM B363 and MGMT B371) This course is an overall introduction to the nature and scope of entrepreneurship. The entrepreneurial process as well as the entrepreneurial profile is examined in detail. It includes the planning, financing, launching and harvesting of a new venture. Entrepreneurial strategies are discussed for all facets of the business including franchising, growth and international aspects. Application of entrepreneurship to large corporations, i.e. entrepreneurship, is also a part of the course.','B380',3,'Undergraduate')
,(260,50,'Environmental Ethics','Examination of principles and arguments surrounding moral issues involving the environment.','B341',3,'Undergraduate')
,(261,26,'Epic to Romance','{CPLT B380} Comprehensive exploration of medieval and other pre-Renaissance literature using texts representative of the evolution of dominant literary forms.','B380',3,'Undergraduate')
,(262,10,'Essential of OrganicI Chemistry Laboratory II','(Prerequisite: CHEM B331L or, consent of instructor; Prerequisite or Co-requisite: CHEM B334) Continuation of CHEM B331L. Spectroscopic identification of carbon compounds. Three laboratory hours per week.','B332L',1,'Undergraduate')
,(263,10,'Essentials of Organic Chemistry Laboratory I','(Prerequisite or Co-requisite: CHEM B333) Laboratory safety, syntheses, separation and purification of carbon compounds.','B331L',1,'Undergraduate')
,(264,51,'Essentials of Physics','(Prerequisite: a grade of C or better in MATH B141; Co-requisite: PHYS B211L or B201L) Classical mechanics and wave motion. Calculus-level course for students of science and engineering.','B211',3,'Undergraduate')
,(265,51,'Essentials of Physics I Laboratory','(Prerequisite or Co-requisite: PHYS B211).','B211L',1,'Undergraduate')
,(266,51,'Essentials of Physics II','(Prerequisite: a grade of C or better in PHYS B211 and MATH B142; Co-requisite: PHYS B212L) Classical electromagnetism and optics.','B212',3,'Undergraduate')
,(267,51,'Essentials of Physics II Laboratory','(Prerequisite or Co-requisite: PHYS B212).','B212L',1,'Undergraduate')
,(268,48,'Ethical Decision-Making, Legal Issues and Health Policy in Professional Nursing','(Prerequisite: NURS B202 or B301) This course examines legal and ethical issues in healthcare and how they influence health policy. Students study legal principles governing professional nursing practice and explore frameworks to support ethical decision-making across the continuum of care. The nurse''s role in healthcare policy development, implementation and analysis are explored, particularly as it relates to legal and ethical issues affecting practice. Students explore current legal/ethical issues and existing health policies, with an emphasis on how these issues impact access to, and delivery of healthcare services to vulnerable populations.','B450',3,'Undergraduate')
