,(391,9,'Human Anatomy and Physiology II','Functional anatomy and physiology of the human body, including the cardiovascular, endocrine, excretory, reproductive, digestive and respiratory systems. Not available for biology major credit. Three lecture hours and three laboratory hours per week.','B244',4,'Undergraduate')
,(392,9,'Human Biology','Fundamental principles of human biology. Three lecture hours per week. Not for major credit.  (Note: Combination of BIOL B110 & BIOL B120 does NOT satisfy the Natural Science GE requirement)','B120',3,'Undergraduate')
,(393,9,'Human Biology Laboratory','(Prerequisite or Co-requisite: BIOL B120) Exercises dealing with basic concepts of human biology. Not for major credit.','B120L',1,'Undergraduate')
,(394,53,'Human Growth and Development','An Introduction to and survey of physical, mental, social, and emotional developmental patterns evidence from the prenatal period through senescence and death.','B209',3,'Undergraduate')
,(395,9,'Human Physiology','(Prerequisite: CHEM B109) Physiology of the human body, including Nervous, sensory, endocrine, muscle, circulatory, immune, respiratory, digestive, urinary and reproductive systems. Not available for biology majors credit. 3 lecture and 2 laboratory hours.','B234',4,'Undergraduate')
,(396,43,'Human Resource Management','(Prerequisite: MGMT B371) A development of an understanding of personnel administration as a staff function through a study of modern-day concepts and practices. Topics include: research and standards, employment, training and education, safety and health, employee services and industrial relations.','B374',3,'Undergraduate')
,(397,35,'Human Resources in Hospitality Management','(Prerequisites: HRTM B110 and B230) A specialized approach to human resources management in the hospitality industry. Students will analyze contemporary issues and practices, as well as the trends that transform the way people are managed specifically within the hospitality industry.','B451',3,'Undergraduate')
,(398,34,'Human Service Evaluation','(Prerequisite: HMSV B280, or consent of Instructor) Research methods for determining the effectiveness of social programs/interventions (i.e., experimental, quasi-experimental and qualitative designs).','B302',3,'Undergraduate')
,(399,34,'Human Services Internship I','(Prerequisite: HMSV 280 or permission of Instructor) The application of theoretical foundations and human service principles in a supervised human service setting. Requires at least 120 hours of service; participation in three on-campus seminars, or three interviews with instructor or a combination of these; on-line reflections; and a final paper that demonstrates the ability to apply interdisciplinary theories, concepts and principles of practice.','B290',3,'Undergraduate')
,(400,34,'Human Services Internship II','(Prerequisite: HMSV 290 or consent of Instructor) The application of theoretical foundations and human service principles in a supervised human service setting. Requires at least 120 hours of service; participation in three on-campus seminars, or three interviews with instructor or a combination of these; on-line reflections; and a final paper that demonstrates the ability to apply interdisciplinary theories, concepts and principles of practice at a higher level than in the previous internship. (N.B. no more than two internship can be at the same site.)','B298',3,'Undergraduate')
,(401,34,'Human Services Internship III and Capstone Seminar','(Prerequisite: HMSV 298 or permission of Instructor) The application of theoretical foundations and human service principles in a supervised human service setting. Requires at least 120 hours of service; participation in three on-campus seminars, or three interviews with instructor or a combination of these; on-line reflections; a capstone essay that demonstrates the ability to apply interdisciplinary theories, concepts and principles of practice at a higher level than in the previous internship; and submission of a professional portfolio for review. (N.B. no more than two internship can be at the same site.)','B490',3,'Undergraduate')
,(402,34,'Human Services: An Introduction','(Prerequisite: PSYC B101 or SOCY B101 or consent of Instructor). The intention of this course is to acquaint students with an overview of the interdisciplinary field of human services by providing a historical and contemporary survey of human service program literatures. Students will be able to identify the domain of human services as an interdisciplinary area of theory and practice. Specifically, they will be able to master concepts generic to this field of study and apply them in human service situations.','B190',3,'Undergraduate')
,(403,53,'Human Sexual Behavior','Psychological, physiological and sociological factors of human sexual behavior and attitudes.','B214',3,'Undergraduate')
,(404,9,'Ichthyology','(Prerequisite: a grade of C or better in two of the three core courses: BIOL B301, B302, B303) Phylogeny, morphology, behavior, and ecology of fishes. Three lecture and three laboratory hours per week. Several field trips are required.','B436',4,'Undergraduate')
