,(422,48,'Independent Study in Nursing','This course is an advanced study of a particular theme or topic in the nursing through readings, research, and analysis. It is designed for students who have completed basic courses and who want to study specific topics that are not offered in the curriculum or extend learning of a topic from a course already completed (i.e., develop a poster or manuscript based on a scholarly paper). A contract of study is developed through readings, projects, papers, and/or seminars approved by instructor. Up to 3 credits may be contracted and repeated for a total of 6 credits.','B399',1,'Undergraduate')
,(423,50,'Independent Study in Philosophy','(Prerequisite: Contract approval is required).','B399',3,'Undergraduate')
