,(425,53,'Independent Study in Psychology','(Prerequisite: Contract approval is required, and PSYC B101 and consent of instructor) Closely supervised project or research experience in psychology. May be repeated for up to six credit hours. Not for psychology major credit.','B399',1,'Undergraduate')
,(426,54,'Independent Study in Public Health','(Prerequisite: PUBH B310 or consent of instructor) This course examines concepts, emerging trends, issues, and evidence-based practice changes in public health practice. Variable hours between 1 to 4 credits, depending on topic which may include complementary and alternative health practices, working with special populations, emerging public health needs, etc. Students may re-take one additional time for a maximum of 8 credits.','B399',1,'Undergraduate')
