,(434,13,'Industrial or Research Internship','Practical full-time work experience in an area of Computational Science, selected by the student and approved by the Department Chair or Computational Science Program Coordinator.','B699',1,'Graduate')
,(435,53,'Industrial/Organizational Psychology','Psychological techniques applied to various industrial and organizational problem areas, such as management and supervision, morale, efficiency, training, personnel selection and placement and relations among personnel.','B224',3,'Undergraduate')
,(436,38,'Information Security Principles','{CSCI B401} (Prerequisite: CSCI B201) This course extends fundamental computer security concepts, practices, and issues, introducing students in the broader field of information security. Topics include: common attack/threat vectors; information security planning; information security prevention, detection, and response tools and approaches; risk and risk assessment; human factors in information security; legal, ethical, and professional issues.','B401',3,'Undergraduate')
,(437,13,'Information Security Principles','{ISAT B401} (Prerequisite: CSCI B201) This course extends fundamental computer security concepts, practices, and issues, introducing students in the broader field of information security. Topics include: common attack/threat vectors; information security planning; information security prevention, detection, and response tools and approaches; risk and risk assessment; human factors in information security; legal, ethical, and professional issues.','B401',3,'Undergraduate')
,(438,38,'Information Technology Project Management','{CSCI B437} (Prerequisite: CSCI/ISAT B207 and MGMT B371, or consent of instructor) This course introduces students to project management concepts, techniques, and tools used by project managers to plan, initiate, manage and close information technology projects. Topics include: the systems approach to project management; application of a project management framework to the planning and management of scope, cost, people, expectations, risk, communications, and procurement; agile methodologies; project management software.','B437',3,'Undergraduate')
,(439,13,'Information Technology Project Management','{ISAT B437} (Prerequisite: CSCI/ISAT B207 and MGMT B371, or consent of instructor) This course introduces students to project management concepts, techniques, and tools used by project managers to plan, initiate, manage and close information technology projects. Topics include: the systems approach to project management; application of a project management framework to the planning and management of scope, cost, people, expectations, risk, communications, and procurement; agile methodologies; project management software.','B437',3,'Undergraduate')
,(440,28,'Innovation & Entrepreneurial Studies Practicum','(Prerequisite: BADM B380 or consent of instructor) This course focuses on the application of problem-solving skills to reinvent and/or pioneer innovative practices through project development in a field experience.','B450',3,'Undergraduate')
,(441,24,'Instructional Strategies for Elementary Teachers','(Prerequisite: Admission to the Professional Program in Education) This course focuses on research-based instructional strategies for literacy in elementary classrooms. Course content includes cooperative learning, critical literacy, Reader''s and Writer''s Workshop. Specific instruction in the five elements of teaching reading: phonics, phonemic awareness, fluency, vocabulary and comprehension. Reading comprehension and writing processes across the content areas are also included.','B433',3,'Undergraduate')
,(442,24,'Instructional Strategies in Literacy for Early Childhood Teachers','(Prerequisite: EDCI B100, EDCI B243, EDRD B318; Admission to the Professional Program or special permission of the Department Chair. Corequisite: EDRD B425 & EDRD B450P) This course focuses on research-based instructional strategies for literacy in early childhood classrooms. Course content includes cooperative learning, critical literacy, Reader''s and Writer''s Workshop. Specific instruction in the five elements of teaching reading: phonics, phonemic awareness, fluency, vocabulary and comprehension and the 6+1 traits of writing.','B430',3,'Undergraduate')
,(443,36,'Integrated Interdisciplinary Studies I','(Prerequisite: IDST B297; permission of instructor) Students identify two courses in two different disciplines that have a correlative relationship beneficial to students course of study. Student proposal of integrative study due pre-enrollment. Can be repeated up to four credit hours.','B305',1,'Undergraduate')
,(444,36,'Integrated Interdisciplinary Studies II','(Prerequisite: IDST B297; permission of instructor) Students identify two courses in two different disciplines that have a correlative relationship beneficial to students course of study. Student proposal of integrative study due pre-enrollment. Can be repeated up to four credit hours.','B405',1,'Undergraduate')
,(445,39,'Integrated Linguistic Skills for Native Speakers I Integrated Linguistic Skills Native Speakers I','Introduction to foreign language linguistic skills (beginning level 1) with stress on effective communication in both written and spoken language as well as reading comprehension and an understanding of cultural practices for academic purposes.','B101',3,'Undergraduate')
,(446,39,'Integrated Linguistic Skills Native Speakers III','Continuation (intermediate level 1) of foreign language linguistic skills with stress on effective communication in both written and spoken language as well as reading comprehension and an understanding of cultural practices for academic purposes.','B201',3,'Undergraduate')
,(447,39,'Integrated Linguistics Skills Native Speakers II','Continuation (beginning level 2) of foreign language linguistic skills with stress on effective communication in both written and spoken language as well as reading comprehension and an understanding of cultural practices for academic purposes.','B102',3,'Undergraduate')
,(448,42,'Intensive College Algebra','(Prerequisite: qualification through placement) Basic college algebra; linear and quadratic equations, inequalities, functions and graphs of functions, exponential and logarithmic functions, systems of equations. Credit may not be received for both MATH B111L and B111. Offered every semester.','B111L',4,'Undergraduate')
,(449,11,'Intercultural Communication','A study of cultural differences in human communication with focus on theoretical and experiential approaches toward gaining competence in communicating across cultures. (Satisfies USCB General Education Global Citizenship and Multicultural Understanding Requirement).','B285',3,'Undergraduate')
,(450,36,'Interdisciplinary Research Methods','(Prerequisite: ENGL B101 or B105 with a grade of C or higher, and Prerequisite or Corequisite of B102 or B106,). Introduction to individualized study including initial development of course of study proposal, review of courses, and bibliography.','B297',3,'Undergraduate')
,(451,36,'Interdisciplinary Studies Internship','(Prerequisite: IDST Major or Minor only, IDST B297, or consent of instructor) Provides students with the opportunity to apply interdisciplinary research skills across culturally diverse populations in a professional setting. Minimum requirement of 150 service hours. Can be repeated once.','B250',3,'Undergraduate')
,(452,18,'Intergrating the Arts in Elementary Education: Art, Music and Movement','(Prerequisite or Co-requisite: EDCI B100) Provides opportunities to develop competence in selecting and using a variety of high quality instructional methods, resources, and assessment strategies for teaching art, music, and movement to elementary children.','B330',3,'Undergraduate')
,(453,1,'Intermediate Accounting I','(Prerequisite: Grade of C or higher in ACCT B226) A detailed study of the preparation and presentation of the balance sheet, income statement, statement of retained earnings, and statement of cash flows. Includes a comprehensive analysis of financial transactions related to revenues and assets, with an emphasis on revenue recognition, and asset valuation issues.','B425',3,'Undergraduate')
,(454,1,'Intermediate Accounting II','(Prerequisite: Grade of C or higher in ACCT B425) A continuation of the detailed study of the preparation and presentation of financial statements. Problem solving techniques and the ability to structure problem solutions will be stressed.','B426',3,'Undergraduate')
,(455,60,'Intermediate Acting','(Prerequisite: THEA B170) A continuation of THEA B170.','B370',3,'Undergraduate')
