,(457,52,'Internatioanl Relations','International political behavior and institutions.','B315',3,'Undergraduate')
,(458,8,'International Business','(Prerequisites: MGMT B371) Introduces the student to economic, financial, legal, political, cultural, institutional and managerial considerations associated with international business transactions.','B383',3,'Undergraduate')
,(459,43,'International Management','(Prerequisite: Junior standing) This course will apply the basic principles of management and leadership to the firm operating internationally. Emphasis is placed on the management functions of leading, planning, organizing and controlling, as well as the conduct of labor relations, within the framework of a multicultural environment.','B411',3,'Undergraduate')
,(460,1,'Internship in Accounting','(Prerequisite: ACCT B226 and one upper level accounting concentration class with a grade of C or higher; and consent of the instructor) Experiential learning in a public or private accounting setting. This course may be repeated once with the approval of the Department Chair and consent of the Instructor.','B429',2,'Undergraduate')
,(461,8,'Internship in Business','(Prerequisites: Junior standing, 2.5 GPA, MKTG B350, BADM B345 and an approved contract with the Internship Coordinator) This course provides students in all disciplines with the opportunity to reinforce classroom learning by working in their discipline in a supervised business environment. This course may be repeated with the approval of the Department Chair and the students academic advisor.','B429',3,'Undergraduate')
,(462,11,'Internship in Communication Studies','(Prerequisite: Communication Studies Major only, 15 hours of communication studies, consent of instructor). Provides students with the opportunity to apply skills and knowledge across socially and culturally diverse populations in a professional setting. Minimum requirement of 150 service hours. May be repeated for a maximum of 12 credit hours.','B495',3,'Undergraduate')
,(463,17,'Internship in Early Childhood Education','(Prerequisite: Admission to the Professional Program in Education and the Internship; Co-requisite: EDEC B476) A program of observation and teaching in the public schools under the supervision of university and public school personnel.','B469',12,'Undergraduate')
,(464,18,'Internship in Elementary School','(Prerequisite: Admission to the Professional Program in Elementary Education; Co-requisite: EDEL B476) A program of observation and teaching in the public schools under the supervision of university and public school personnel.','B470',12,'Undergraduate')
,(465,41,'Internship in Media Arts','(Prerequisite: MART B310 or B381 or permission of instructor) Supervised experience in media production facilities. Can be taken for 1-3 credits based on 50 contact hours per credit, and contract must be approved by instructor, advisor, and department head.','B499',3,'Undergraduate')
,(466,53,'Internship in Psychology','(Prerequisite: Psychology Majors only, 15 hours of psychology, consent of instructor) Provides experience in a professional setting to facilitate integration of academic knowledge with real world. Minimum requirement of 150 service hours.','B495',3,'Undergraduate')
,(467,53,'Internship in Psychology II','(Prerequisite: Psychology Majors only, PSYC B495, and consent of instructor) Provides experience in a professional setting to facilitate integration of academic knowledge with real world. Required service hours: 150 - 300 (depending on credit hours).','B496',3,'Undergraduate')
,(468,54,'Internship in Public Health','(Prerequisite: PUBH B450; Co-requisite: PUBH B460) A period of work-related education that allows students to reinforce classroom learning while gaining practical experience in a supervised setting where public health principles are applied.','B480',4,'Undergraduate')
,(469,21,'Internship in Secondary Mathematics Education','(Co-requisite: EDME B476) A program of observation and teaching secondary mathematics in the public schools under the supervision of university and public school personnel.','B469',12,'Undergraduate')
,(470,56,'Internship in Sociology','(Prerequisite: Sociology Majors only, 15 hours of sociology, consent of instructor) Provides experience in a professional setting to facilitate integration of academic knowledge with real world experience. Requires at least 150 hours of service, online reflections and a final paper that demonstrates the ability to apply theories, concepts and principles of practice.','B495',3,'Undergraduate')
,(471,34,'Internship IV','(Prerequisite: HMSV B490 and permission of instructor, and approved contract with internship agency.) The application of theoretical foundations and human service principles in a supervised human service setting. Requires at least 120 hours of service, participation in seminars, written reflections, and a final paper that demonstrates the ability to apply interdisciplinary theories, concepts and principles of practice at a higher level than in the previous internships. (Maximum of two internships can be taken at the same site.)','B492',3,'Undergraduate')
,(472,11,'Interpersonal Communication','Presents basic concepts for understanding communication in interpersonal relationships. It combines a theoretical approach with a skills approach to the study of interpersonal communication.','B201',3,'Undergraduate')
,(473,2,'Introduction to African-American Studies I','A broad introduction to the history, culture, religion, institutions, politics, economics, arts, and psychology of people of African descent as developed from experience in both the old and new worlds.','B201',3,'Undergraduate')
,(474,2,'Introduction to African-American Studies II',NULL,'B202',3,'Undergraduate')
