,(478,53,'Introduction to Clinical Psychology','(Prerequisite: PSYC B311 and B341 or consent of instructor) An introduction to the science and practice of clinical psychology. Application of psychological principles to the assessment and treatment of mental disorders and behavioral problems in human beings.','B411',3,'Undergraduate')
,(479,11,'Introduction to Communication Studies','An introduction to communication studies as a field of study, including the concepts, ideas, issues, research methods and theories associated with the discipline.','B190',3,'Undergraduate')
,(480,13,'Introduction to Computational Biology','{CSCI B255} (Prerequisite: CSCI B104 or BIOL B101 or consent) Introduction to the Linux operating system, an introduction to computational tools used in exploring and analyzing biological data.','B255',3,'Undergraduate')
,(481,38,'Introduction to Computational Biology','{ISAT B255} (Prerequisite: CSCI B104 or BIOL B101 or consent) Introduction to the Linux operating system, an introduction to computer science and programming using high-level languages, and a survey of various computational tools used in exploring and analyzing biological data.','B255',3,'Undergraduate')
,(482,13,'Introduction to Computational Science','{ISAT B150} (Prerequisite: two years of college preparatory mathematics or equivalent) Topics include computing theories, programming languages, modeling/simulation and visualization tools, and case studies of problem solving and high performance computing in natural sciences.','B150',3,'Undergraduate')
,(483,13,'Introduction to Computer Architecture','{CSCI B212} (Prerequisite: CSCI B211) Organization and architecture of computer systems hardware; instruction set architectures; addressing modes; register transfer notation; processor design and computer arithmetic; memory systems; hardware implementations of virtual memory, and input/output control and devices.','B212',3,'Undergraduate')
,(484,38,'Introduction to Computer Architecture','{ISAT B212} (Prerequisite: CSCI B211) Organization and architecture of computer systems hardware; instruction set architectures; addressing modes; register transfer notation; processor design and computer arithmetic; memory systems; hardware implementations of virtual memory, and input/output control and devices.','B212',3,'Undergraduate')
,(485,13,'Introduction to Computer Concepts','(Prerequisite: two years of college preparatory mathematics or equivalent) History, application and social impact of computers; problem-solving, algorithm development, applications software and programming in a procedural language. Open to all majors.','B101',3,'Undergraduate')
,(486,13,'Introduction to Computer Networks','{CSCI B416} (Prerequisite: CSCI B145 or consent) Fundamental concepts in computer networks, protocols, and applications. Topics include: network architectures, transmission media, protocols, wireless networks, routing, security and latest topics.','B416',3,'Undergraduate')
