,(488,38,'Introduction to Computer Science','{CSCI B150} (Prerequisite: two years of college preparatory mathematics or equivalent) Topics include computing theories, programming languages, modeling/simulation and visualization tools, and case studies of problem solving and high performance computing in natural sciences.','B150',3,'Undergraduate')
,(489,38,'Introduction to Computer Security','{CSCI B201} (Prerequisite or Co-requisite: CSCI B104 or ISAT B104) This course will provide students with an introduction to the theory and practice of computer security. Topics to be covered include: security policies, authentication, digital certificates, firewalls, malicious code, legal and ethical issues, and incident handling. [This is the first required course in the ISAT Cybersecurity concentration.]','B201',3,'Undergraduate')
,(490,13,'Introduction to Computer Security','{ISAT B201} (Prerequisite or Co-requisite: CSCI B104 or ISAT B104) This course will provide students with an introduction to the theory and practice of computer security. Topics to be covered include: security policies, authentication, digital certificates, firewalls, malicious code, legal and ethical issues, and incident handling. [This is the first required course in the ISAT Cybersecurity concentration.]','B201',3,'Undergraduate')
,(491,38,'Introduction to Data Mining','{CSCI B422} (Prerequisite: MATH B230 or CSCI/MATH B280, STAT B340 and CSCI B320) Introduction to information processing techniques and mathematical tools to assemble, access, and analyze data for decision support and knowledge discovery.','B422',3,'Undergraduate')
,(492,13,'Introduction to Data Mining','{ISAT B422} (Prerequisite: MATH B230 or CSCI/MATH B280, STAT B340 and CSCI B320) Introduction to information processing techniques and mathematical tools to assemble, access, and analyze data for decision support and knowledge discovery.','B422',3,'Undergraduate')
,(493,38,'Introduction to Data Structures and Algorithms','{CSCI B350} (Prerequisite: CSCI/MATH B280 [or MATH B230 and MATH B242], and CSCI B146 or consent) Core techniques in the scientific computing process; the focus is on numerical methods, data structures, and computing optimization.','B350',3,'Undergraduate')
,(494,13,'Introduction to Data Structures and Algorithms','{ISAT B350} (Prerequisite: CSCI B146 or consent) Core techniques in the scientific computing process; the focus is on numerical methods, data structures, and computing optimization.','B350',3,'Undergraduate')
,(495,59,'Introduction to Descriptive Statistics','Computational and graphical techniques for organizing and presenting statistical data. Sample mean and sample variance, cross tabulation of categorical data, correlation and simple linear regression, quality control charts, statistical software.','B110',3,'Undergraduate')
,(496,38,'Introduction to Digital Forensics','{CSCI B317} (Prerequisite: CSCI B201/ISAT B201 or Permission of Instructor) This course will provide students with an introduction to the field of digital forensics and e-discovery. Topics to be covered include the scientific method of digital forensics, electronic discovery, legal issues related to digital analysis, and mobile technologies. Students will learn basic procedures and requirements for conducting digital forensics on a variety of platforms, including Windows, iOS, and Android devices.','B317',3,'Undergraduate')
,(497,13,'Introduction to Digital Forensics','{ISAT B317} (Prerequisite: CSCI B201/ISAT B201 or Permission of Instructor) This course will provide students with an introduction to the field of digital forensics and e-discovery. Topics to be covered include the scientific method of digital forensics, electronic discovery, legal issues related to digital analysis, and mobile technologies. Students will learn basic procedures and requirements for conducting digital forensics on a variety of platforms, including Windows, iOS, and Android devices.','B317',3,'Undergraduate')
,(498,13,'Introduction to Digital Image Processing','(Prerequisite: CSCI B104 or CSCI B145, MATH B230 or CSCI/MATH B280, STAT B340) Overview of digital image processing techniques and their applications; transforms, enhancement, analysis, segmentation, compression, color image processing; computer projects.','B463',3,'Undergraduate');
INSERT INTO Courses([CoursesID],[SubjectsID],[CourseTitle],[CourseDescription],[CourseNumber],[CreditHours],[Levels]) VALUES
 (499,23,'Introduction to Educational Psychology','(Prerequisite or Co-requisite: EDCI B100) This course will introduce pre-service teachers and education majors to psychological principles, theory and data upon which effective classroom practices are based, including general methods and techniques. A variety of teaching methods for classroom management will be considered with the focus on the teacher as a decision maker in planning, evaluation and control. Emphasis will be placed on student motivation, learning problems, individual differences and measurement.','B335',3,'Undergraduate')
,(500,27,'Introduction to Engineering','Engineering problem solving using computers and other engineering tools.','B101',3,'Undergraduate')
,(501,26,'Introduction to English Studies','(Prerequisite: ENGL B101 or B105, and ENGL B102 or B106, each with a C or higher.) An introduction to the history, present state, and potential futures of English Studies with an emphasis on the distinctive fields, methods, and terminology employed in the discipline of English.','B200',3,'Undergraduate')
,(502,28,'Introduction to Entrepreneurial Thinking & Innovation','(Prerequisite: Sophomore standing) This introductory course focuses on exploring the concepts of innovation and entrepreneurship in the context of today''s world, and exploring one''s own entrepreneurial spirit. Through self-assessment, the student will learn to capitalize on personal strengths and develop skills that lead to innovative thinking.','B300',3,'Undergraduate')
,(503,9,'Introduction to Environmental Biology','Basic ecological principles and the impacts of human population growth and technology. Not for major credit.','B270',3,'Undergraduate')
,(504,9,'Introduction to Environmental Biology Laboratory','(Prerequisite or Co-requisite: BIOL B270) Demonstrations, data analyses, discussions and films relating to human ecology, resource use and environmental impact. Two hours per week. Not for major credit.','B270L',1,'Undergraduate')
,(505,54,'Introduction to Environmental Health','(Prerequisite: PUBH B310) The study of environmental factors, be they physical, chemical, biological or behavioral that have the potential to adversely impact human and/or ecological health.','B340',3,'Undergraduate')
,(506,33,'Introduction to Environmental History','A survey of the western past with the environment introduced as a significant actor and object of inquiry. Emphases include the impact of changing environments on several societies as well as changing human attitudes toward the environment.','B315',3,'Undergraduate')
,(507,35,'Introduction to Event Management','This course provides an overview of producing community oriented special events.','B210',3,'Undergraduate')
,(508,19,'Introduction to Exceptional Learner','(Admission to the Professional Program or consent of Department Chair). A survey of the development of special education, the current legal guidelines with emphasis on public school mandates, the various clusters of exceptionalities: their definition, classification, identification, prevalence, causes, characteristics and educational needs, including mainstreaming in the regular classroom.','B300',3,'Undergraduate')
,(509,19,'Introduction to Exceptional Populations at the Secondary Level','(Prerequisite: EDRD B319 & EDCI B320) Introductory course designed to survey the development of special education in high school settings; the current legal guidelines with emphasis on public school mandates; the various clusters of exceptionalities, their definitions, classification, identification, prevalence, causes, characteristics, education needs; and the inclusion of students with exceptionalities within the general education classroom at the secondary level.','B301',3,'Undergraduate')
,(510,54,'Introduction to Exercise and Sports Science','(Prerequisite: BIOL B243 and BIOL B244) This course is designed to examine the disciplines in the broad field of exercise science. An overview of the knowledge and skills needed to become a certified personal trainer (CPT) will be provided.','B323',3,'Undergraduate')
,(511,26,'Introduction to Film','(Prerequisite: ENGL B101 with a grade of C or higher) Introduction to critical analysis of film (for all majors).','B180',3,'Undergraduate')
,(512,50,'Introduction to Formal Logic: Deduction & Inference','This course is an introduction to deductive reasoning. The focus will be on the use of formal methods to construct and criticize actual arguments. Particular emphasis will be placed upon Aristotelian logic, sentential logic, and predicate logic. Student will develop skills in the development and analysis of syllogisms, Venn Diagrams, truth tables, and formal proofs.','B110',3,'Undergraduate')
,(513,38,'Introduction to Front-End Web Development','{CSCI B202} (Prerequisite: CSCI B145 and B150) Application of programming techniques to the development of interactive, event-driven web applications. Brief coverage of document markup (HTML) and styling (CSS) essentials, followed by significant coverage of scripting languages, libraries, and frameworks for manipulating the Document Object Model.','B202',3,'Undergraduate')
,(514,13,'Introduction to Front-End Web Development','{ISAT B202} (Prerequisite: CSCI B145 and B150) Application of programming techniques to the development of interactive, event-driven web applications. Brief coverage of document markup (HTML) and styling (CSS) essentials, followed by significant coverage of scripting languages, libraries, and frameworks for manipulating the Document Object Model.','B202',3,'Undergraduate')
,(515,56,'Introduction to Gender Studies','(Prerequisite: SOCY B101 or PSYC B101 or permission of instructor) Theories, methods and substantive issues in the study of gender and sexuality, grounded in the social sciences and humanities, using an interdisciplinary approach.','B301',3,'Undergraduate')
,(516,43,'Introduction to Health Care Management','(Prerequisite: Junior Standing) This course will provide students with the opportunity to develop a general understanding of the health care industry and managerial and organizational aspects of health care organizations. Students will learn to apply management concepts, processes, and theoretical ideas in addressing management problems in health care organizations and in the operation of health care systems. Course activities will enable students to learn the importance of identifying and managing finite resources, complying with ethical and legal standards, and recognizing tradeoffs between patient care and financial accountability.','B355',3,'Undergraduate')
,(517,35,'Introduction to Hospitality Industry','History, growth, developments and future opportunities in the hospitality industry.','B110',3,'Undergraduate')
,(518,38,'Introduction to HTML and CSS','{CSCI B102} (Prerequisite: two years of college preparatory mathematics) Introduction to systematic computer problem-solving and programming for a variety of applications. Open to all majors.','B102',3,'Undergraduate')
,(519,13,'Introduction to HTML and CSS','{ISAT B102} (Prerequisite: two years of college preparatory mathematics) Introduction to systematic computer problem-solving and programming for a variety of applications. Open to all majors.','B102',3,'Undergraduate')
,(520,50,'Introduction to Informal Logic: Reasoning & Analysis','This course is an introduction to inductive reasoning. The focus will be on argumentation and argument analysis. Students will develop skills for: identifying argumentative language; determining the type of argument present; constructing argument maps; evaluating arguments in term of inductive standards; and identifying various informal fallacies.','B111',3,'Undergraduate')
,(521,26,'Introduction to Journalism and Media Studies','Introduction to practical skills of contributing to and running a print publication supported by analysis of various media and communication paradigms.','B190',3,'Undergraduate')
,(522,33,'Introduction to Latin American Civilization','A discussion of the political, cultural and economic forces which have conditioned the development of institutions and ideas in Spanish and Portuguese America. (Satisfies USCB General Education Global Citizenship and Multicultural Understanding Requirement).','B109',3,'Undergraduate')
,(523,16,'Introduction to Life Science Education','Students will engage in the major themes (principles) of biology through active inquiry and hands-on learning experiences. This course includes exploring topics in evolution, biological systems, energy transfer, exploring natural phenomena through the research process, and, the nature of science. The course includes three-hour lectures and three hours of laboratory practices. Students will explore the Next Generation of Science Standards K-16 science and engineering practices and crosscutting concepts.','B220',3,'Undergraduate')
,(524,45,'Introduction to Marketing Research','(Prerequisites: MKTG B350 and STAT B201) Principles and concepts underlying marketing functions, including the conception, pricing, promotion and distribution of products and services and the role of marketing in society.','B352',3,'Undergraduate')
,(525,36,'Introduction to Medical and Health Humanities','(Prerequisite: ENGL B101 or B105 & B102 or B106, each with a grade of C or higher.) An interdisciplinary course designed for students to focus on the broadly encompassing field of health and medicine from the perspective of the humanities.','B260',3,'Undergraduate')
,(526,47,'Introduction to Music','Perceptive listening and appreciation of musical elements, forms and style periods, including composers lives, individual styles and representative works. Emphasis on classical music; jazz and American popular music included.','B110',3,'Undergraduate')
,(527,26,'Introduction to Non-Western Literature','{CPLT B291} (Prerequisite: ENGL B101 or B105, and ENGL B102 or B106, each with a C or higher.) Selected masterpieces of non-Western literature. Works may range from antiquity to the present. (Satisfies USCB General Education Global Citizenship and Multicultural Understanding Requirement). Appropriate for students from any discipline.','B291',3,'Undergraduate')
,(528,12,'Introduction to Non-Western Literature','{ENGL B291} Selected masterpieces of non-western literature. Works may range from antiquity to the present. (Satisfies USCB General Education Global Citizenship and Multicultural Understanding Requirement).','B291',3,'Undergraduate')
,(529,60,'Introduction to Performance Studies','(Prerequisite: Junior standing or consent of instructor) An introduction to the field of performance studies including a history of the field, theories of performance and a broad look at the different behaviors and cultural artifacts performance studies scholars examine.','B410',3,'Undergraduate')
,(530,8,'Introduction to Personal Finance','Financial Planning and literacy from a personal perspective. Topics include money management skills, taxes, banking, savings, credit, debt management, careers, consumer purchasing strategies, housing, insurance, investments, and retirement.','B150',3,'Undergraduate')
,(531,50,'Introduction to Philosophy','An introduction to the main problems of philosophy and its methods of inquiry, analysis and criticism. Works of important philosophers will be read.','B102',3,'Undergraduate')
,(532,30,'Introduction to Physical Geography','Basic concepts of landform geography, climatology and meteorology and biogeography.','B200',3,'Undergraduate')
,(533,52,'Introduction to Politics','Concepts and problems involved in human relationship with governments, the nation-state and political change.','B105',3,'Undergraduate')
,(534,59,'Introduction to Probabilty and Statistics','(Prerequisite: MATH B240 or consent.) Set theory; distributions of both discrete and continuous random variables; moments (including moment generating and characteristic functions); limit theorems; multivariate distributions including marginal and conditional distributions; confidence intervals and hypothesis tests.','B340',3,'Undergraduate')
,(535,42,'Introduction to Proof','(Prerequisite: Qualification through placement or a grade of C or better in MATH B142) Introduction to the language and nature of reasoning, structure, and technique as they apply to advanced mathematics and proofs. Topics include logic, set theory, cardinality, and methods of proof (including induction). Offered every semester.','B300',3,'Undergraduate')
,(536,53,'Introduction to Psychology','An introduction to and survey of the basic concepts and findings within the field of psychology.','B101',3,'Undergraduate')
,(537,52,'Introduction to Public Administration','A study of the basic principles and theory of administrative structure, responsibility and control in relation to policy making in the modern state.','B370',3,'Undergraduate')
,(538,54,'Introduction to Public Health','A broad-based overview of those processes that enable people to assume responsibility for health and wellness and the role of the public health professional.','B310',3,'Undergraduate')
,(539,11,'Introduction to Public Relations','(Prerequisite: COMM B210) A cross-disciplinary approach to the practice of public relations and its role in contemporary society, including a theoretical and practical understanding of relationship management.','B328',3,'Undergraduate')
,(540,57,'Introduction to Reading Hispanic Literary Text','(Prerequisite: Placement at 300 level on Phase II placement exam, grade of C or better in SPAN B301 or SPAN B302 or consent of instructor. Department consent required for transfer students.) Approaches to reading literary texts through carefully selected readings from different genres. Taught in Spanish.','B312',3,'Undergraduate')
,(541,55,'Introduction to Religious Studies','An introduction to the methods of religious inquiry and to the beliefs and practices of major religious traditions.','B110',3,'Undergraduate')
,(542,26,'Introduction to Rhetorical Theory','(Prerequisite: ENGL B101 or B105, and ENGL B102 or B106, each with a C or higher.) This course acquaints students with historic and current rhetorical theory.','B244',3,'Undergraduate')
,(543,33,'Introduction to Scottish History','A survey of Scottish history with an emphasis on national identity and identity formation.','B330',3,'Undergraduate')
,(544,60,'Introduction to Script Analysis','(Prerequisite: ENGL B101 and B102, or equivalent) In this course, students will apply research and analysis skills to dramatic texts with an eye toward serving theatrical productions.','B201',3,'Undergraduate')
,(545,56,'Introduction to Social Inequality','This course applies a sociological framework to understand social stratification and inequality. Students will learn major sociology paradigms or metatheories of the relationship of society to the individual and will apply them in the empirical analysis of social inequality.','B309',3,'Undergraduate')
,(546,56,'Introduction to Social Problems','Normative dissensus and behavioral deviance in society and their consequences for social change and social order. Problems may include: mental disorders, juvenile delinquency, crime, drug abuse, alcoholism, suicide, sexual pathology, race and ethnic relations, world population crises and work problems.','B340',3,'Undergraduate')
,(547,38,'Introduction to Software Engineering','{CSCI B240} (Prerequisite: ISAT B145 or consent of instructor) Fundamentals of software design and development; software implementation strategies; object-oriented design techniques; ethics in software development.','B240',3,'Undergraduate')
,(548,13,'Introduction to Software Engineering','{ISAT B240} (Prerequisite: CSCI B145 or consent of instructor) Fundamentals of software design and development; software implementation strategies; object-oriented design techniques; ethics in software development.','B240',3,'Undergraduate')
,(549,35,'Introduction to Spa Management','This course explores the world of spas including spa history, spa types, current trends and growth, and issues affecting spas, spa managers and spa clients.','B215',3,'Undergraduate')
,(550,35,'Introduction to Sport and Event Management','This course introduces the student to the sport management profession. Industry employment opportunities along with requisite professional skills are reviewed.','B201',3,'Undergraduate')
,(551,58,'Introduction to Sport Management','This course introduces the student to the sport management profession. Industry employment opportunities along with requisite professional skills are reviewed.','B201',3,'Undergraduate')
,(552,9,'Introduction to Sustainability','(Prerequisite: a grade of C or better in two of the three core courses: BIOL B301, B302, B303) This course introduces students to the principles of sustainability as they apply to the environment, economy and social issues. The course format will primarily be interactive classroom experiences and experiential exercises (i.e., hands-on, real-life activities and projects). Standard course materials will be supplemented by guest speakers drawn from our local community.','B495',3,'Undergraduate')
,(553,26,'Introduction to Technical Writing','(Prerequisite: ENGL B102, with a grade of ''C'' or higher) An introduction to the basic concepts, processes, and genres of technical writing. Students practice using technical writing skills to communicate specialized or technical information to non-specialist audiences. Recommended for engineers, scientists, and computer scientists.','B262',3,'Undergraduate')
,(554,6,'Introduction to Visual Arts Computing','A foundations level course in the use of personal computers and discipline-related software as aids in visual art and design.','B102',3,'Undergraduate')
,(555,26,'Introduction to Workplace Writing','(Prerequisite: a grade of C or better in ENGL B102) An introduction to rhetorically-effective writing for workplace audiences, including common workplace genres (e.g. professional emails, reports, and resumes) and practice in collaborative writing, document design, and revision.','B263',3,'Undergraduate')
,(556,42,'Introductory Mathematics for Comutational Science','(Prerequisite: Qualification through placement or a grade of C or better in MATH B111 or consent) Sets, functions, analytic geometry, matrices and Euclidean spaces, infinites series, approximation, precision and error, counting and probability, graphs and trees; fundamental notions of differential and integral calculus.','B131',3,'Undergraduate')
,(557,56,'Introductory Sociology','An introduction to sociological facts and principles: an analysis of group-making processes and products.','B101',3,'Undergraduate')
,(558,9,'Invertebrate Zoology','(Prerequisite: a grade of C or better in two of the three core courses: BIOL B301, B302, B303) Phylogenetic and comparative aspects of anatomy, physiology, reproduction and embryology of the invertebrates. Three lecture and one three-hour laboratory per week.','B410',4,'Undergraduate')
,(559,15,'Issues in Economics','(Prerequisites: ECON B221, B222) The nature and causes of major economic problems facing the nation and its communities and policy alternatives designed to solve them. The philosophy and methodology of economics in social problem solving.','B311',3,'Undergraduate')
,(560,47,'Jazz and American Popular Music','Development of jazz and American popular music through the study of important soloists, ensembles, arrangers and composers.','B140',3,'Undergraduate')
,(561,26,'Journalism Laboratory','Supervised participation in the production of the Tidal Tribune. May be repeated for up to 8 credits.','B191',3,'Undergraduate')
,(562,49,'Karate','Explore different martial arts styles with emphasis on basic hand strikes, kicks, blocks, stances, fighting strategy, martial art theory, history and selfdefense strategies.','B117',1,'Undergraduate')
,(563,49,'Kayaking','(Prerequisite: successful completion of deep water swim exam) Supervised calm water single kayak paddling. Emphasis on safety, equipment selection, basic paddle and kayak-handling techniques, fitness considerations, travel safety, rescue and survival techniques.','B147',1,'Undergraduate')
,(564,15,'Labor Economics','(Prerequisites: ECON B221, B222) A study of labor market institutions, trends in labor market activity and the effects of government policy on the labor market.','B406',3,'Undergraduate')
,(565,18,'Language Arts in the Elementary School','(Prerequisite: EDCI B100, EDRD B218 and admission to the Department of Education''s Teacher Education Professional Program for Elementary Education) This course focuses on methods of teaching language arts and writing in grades 2-6. Course content includes strategies for teaching the conventions of language, the writing process, writing traits, assessment methods, and incorporating content area reading and writing.','B434',3,'Undergraduate')
,(566,26,'Late Shakespeare','Shakespeares late poetry and plays, with representative works by his contemporaries.','B406',3,'Undergraduate')
,(567,33,'Latin America: The Founding of New Societies','The establishment of consolidation of the Spanish and Portuguese empires in the Western hemisphere; interaction of Indians, Africans and Iberians and the formation of social, economic and political traditions in Latin America; political independence.','B420',3,'Undergraduate')
,(568,54,'Leadership and Management in Public Health','(Prerequisite: PUBH B310) This course is designed to enhance leadership and management skills needed to design, implement and evaluate public health programs.','B420',3,'Undergraduate')
,(569,34,'Leadership and Professional Ethics in Human Services','(Prerequisite or co-requisite: HMSV B302 or consent of Instructor) An exploration of leadership in human service settings and the essentials involved in managing information, human resources and fiscal resources in human service agencies with an emphasis on non-profit organizations. In addition, the course will explore professional ethics and legal issues involved in facing challenges such as privacy, confidentiality, informed consent, freedom of information and information security.','B400',3,'Undergraduate')
,(570,43,'Leadership in Organizations','(Prerequisite: MGMT B371) Reviews research and practice in organizational leadership; provides students with self-assessment, developmental exercises and case studies to prepare for leadership roles.','B403',3,'Undergraduate')
,(571,61,'Leadership in Practice','(Prerequisite: By invitation only, following competitive application process) This course explores the practice of leadership and engages outstanding students in an active dialogue about the challenges of being a leader within the university context and beyond.','B491',3,'Undergraduate')
,(572,28,'Leading Diverse Teams','(Prerequisite: Junior Standing) This course explores contemporary leadership practices with an emphasis on leading diverse teams. Students explore best practices that support diversity, equity, and inclusion to create dynamic, forward-thinking teams.','B400',3,'Undergraduate')
,(573,48,'Leading in Organizations','(Prerequisite: Acceptance to RN to BSN program or NURS B326 or permission of instructor) This course examines the organizational and care delivery models where nurses lead, manage, and follow. Human resource practices; legal, regulatory, and risk management functions; quality improvement and change management techniques; and delegation expectations of the nurse are examined. Students are introduced to organizational and leadership theories.','B410',3,'Undergraduate')
,(574,53,'Learning and Memory','(Prerequisite: PSYC B101) Research and applications concerning the acquisition of new behavior and knowledge, including accounts based on classical and instrumental conditioning and on information-processing models.','B302',3,'Undergraduate')
,(575,9,'Life and Death in the Salt Marsh','(Prerequisite: a grade of C or better in two of the three core courses: BIOL B301, B302, B303) Intensive Summer May Term course teaching field research methods, statistical design, and culminating in an independent research project on aspects of ecological processes of Beaufort and surrounding counties. Students will spend more than 5 hours per day in classroom/field-laboratory context planning, developing, researching background, and carrying out their research project, approved and facilitated by course faculty.','B448',4,'Undergraduate')
,(576,53,'Life Span Developmental Psychology','(Prerequisite: PSYC B101) Psychological development from conception to late adulthood. Topics include physical, cognitive and social processes associated with development at each stage of the life cycle.','B321',3,'Undergraduate')
,(577,54,'Life-Cycle Nutrition','(Prerequisite: HRTM/PUBH B242) This course examines the essentials of human nutrition and the modification of nutritional needs at different life stages, including pregnancy, lactation, infancy, childhood, adolescence, adulthood, and older adulthood.','B322',3,'Undergraduate')
,(578,49,'Lifeguard Training','(Prerequisite: Permission of the PEDU Program Coordinator) Students will develop proficiency in water safety skills. Successful completion of all course requirement leads to certification in American Red Cross Lifeguard Training, CPR, First Aid, and AED.','B142',3,'Undergraduate')
,(579,42,'Linear Algebra','(Prerequisite: MATH B141 or consent of instructor) Linear systems and matrices, vector spaces, linear independence, rank of a matrix, linear transformations, determinants, introduction to eigenvalues and eigenvectors, diagonalization and applications. Offered Fall semester.','B230',3,'Undergraduate')
,(580,24,'Literacy/Social Studies Practicum','(Prerequisite: Admission to the Professional Program in Education and the Internship; Co-requisite: EDRD B420 and EDRD B430 or B433). Supervised clinical experience in an early childhood or elementary setting. Teacher candidates will demonstrate proficiency in planning, assessing and teaching various methods of reading and providing individualized differentiated instruction for struggling/ELL students.','B450P',3,'Undergraduate')
,(581,57,'Literary Tendencies and Masterpieces of Spain I','(Prerequisite: SPAN B312 or consent of instructor) A survey of the masterworks and literary tendencies of Spain from the Middle Ages to the 17th century. Taught in Spanish.','B404',3,'Undergraduate')
,(582,57,'Literary Tendencies and Masterpieces of Spain II','(Prerequisite: SPAN B312 or consent of instructor) A survey of the masterworks and literary tendencies of Spain from the 18th century to present day. Taught in Spanish.','B406',3,'Undergraduate')
,(583,57,'Literary Tendencies and Masterpieces of Spanish America I','(Prerequisite: SPAN B312 or consent of instructor) A survey of the masterworks and literary tendencies of Spanish America from the Pre-Columbian Era to Independence. Taught in Spanish.','B405',3,'Undergraduate')
,(584,57,'Literary Tendencies and Masterpieces of Spanish America II','(Prerequisite: SPAN B312 or consent of instructor) A survey of the masterworks and literary tendencies of Spanish America from Independence to present day. Taught in Spanish.','B407',3,'Undergraduate')
,(585,61,'Lowcountry Studies Honors Seminar','This seminar will be an introduction to topics, information, reading, and class field trips to reflect the Lowcountry Studies Honors'' experience in the first year of the program. Topics covered will include common readings, discussion of current topics or current events, and professional development of the student. Course can be taken for credit up to two semesters.','B200',1,'Undergraduate')
,(586,34,'Macro Level Human Services Interventions','(Prerequisite or co-requisite: HMSV B280 or consent of Instructor) Exploration of the theories, skills and practices of working with larger groups in human service settings such as grassroots or formal organizations, neighborhoods, communities, geographic regions, political jurisdictions, and societies. Includes community organizing and development, agency collaborations, social change, social marketing and public awareness, advocacy and social policy work. Multicultural and ethical/legal issues related to this level of intervention will be examined.','B300',3,'Undergraduate')
,(587,15,'Macroeconomics','Macroeconomic analysis: basic definitions and concepts: mechanics of pricing and the fundamentals of American capitalism; national income economics, income and employment theory and monetary and fiscal policy.','B222',3,'Undergraduate')
,(588,43,'Management and Operations of Small Business','(Prerequisites: MGMT B371) Analysis of the management and operations of a small business. The course includes the study of an existing small business. The areas of management, finance, marketing and credit as they apply to a small business are studied.','B473',3,'Undergraduate')
,(589,35,'Management by Menu','(Co-requisite: HRTM B311 and B270 - all three must be taken together).Analysis, pricing constraints and mechanics of the menu.','B312',1,'Undergraduate')
,(590,44,'Management Information Systems','(Prerequisite: MGSC B290 or CSCI B101) A study of the concepts, interactions and functions of major business systems with particular emphasis on the problems and issues related to computer based systems. Included are concepts of designing information systems, collecting and processing data, reporting results of operations and controlling the business organization.','B390',3,'Undergraduate')
,(591,9,'Marine Ecology','(Prerequisite: a grade of C or better in two of the three core courses: BIOL B301, B302, B303) Structure, dynamics and interactions between populations and communities in marine ecosystems. Three lecture hours per week.','B475',3,'Undergraduate')
,(592,9,'Marine Ecology Laboratory','(Prerequisite or Co-requisite: BIOL B475) Laboratory and field exercises in coastal environments.','B475L',1,'Undergraduate')
,(593,9,'Marine Internship','(Prerequisite: Sophomore standing) Required paid or unpaid internship or field experience for gaining practical experience in marine biology.','B401',3,'Undergraduate')
,(594,9,'Marine Mammal Biology','(Prerequisite: a grade of C or better in two of the three core courses: BIOL B301, B302, B303) Diversity, anatomy, ecology, energetics, and conservation of marine mammals.','B438',3,'Undergraduate')
,(595,9,'Marine Mammal Biology Lab','(Prerequisite: BIOL B301; Corequisite: BIOL B438) Experimental aspects of marine mammal biology.','B438L',3,'Undergraduate')
,(596,9,'Marine Plants','(Prerequisite: a grade of C or better in two of the three core courses: BIOL B301, B302, B303) Diversity, distribution, physiology, ecology, evolution, and economic importance of marine algal, sea grass and mangrove communities. Three lecture and three laboratory hours per week. Scheduled field trips are required.','B425',3,'Undergraduate')
,(597,9,'Marine Policy','(Prerequisite: a grade of C or better in two of the three core courses: BIOL B301, B302, B303) This course is an overview of strategies and current practices in marine and coastal policy and management and will examine relevant historical and current state, federal and international marine and coastal policy programs and issues. Students will learn directly from professionals in government, academia and non-governmental organizations and stakeholders. Specific emphasis will be put on science communication to policymakers in current issues. This course will be heavily activity-based.','B490',3,'Undergraduate')
,(598,45,'Marketing Communications and Strategy','(Prerequisite: MKTG B350) Integration of advertising, sales promotion, and point-of-purchase communications toward the goal of enhancing brand equity.','B454',3,'Undergraduate')
,(599,45,'Marketing Strategy and Planning','(Prerequisite: MKTG B352) Management of marketing organizations and integration of functions, with emphasis on planning and designing strategies and applying tools and techniques for problem solving and decision making.','B465',3,'Undergraduate')
,(600,13,'Master''s Thesis','Preparation of a thesis for the master''s degree. Repeatable as needed, with approval from the Computer Science department chair.','B799',3,'Graduate')
,(601,17,'Math Experiences in Early Childhood Education','(Prerequisite: EDCI B100; Admission to the Professional Program in Education or consent of the Department Chair; Co-requisites: EDEC B436, EDEC B444, EDEC B440P). This methods course includes the basic content of the academic area of mathematics to be presented to PreK-3rd grade children. Developmentally appropriate experiences, learning activities, materials and equipment to aid in the development of math concepts in young children are presented. Diversity-related influences and needs of exceptional learners are also addressed.','B435',3,'Undergraduate')
,(602,18,'Math/Science Practicum','(Prerequisite: Admission to the Professional Program or permission of the Department Chair; Co-requisite EDEL B431, EDEL B432, and EDEL B434) Supervised clinical experience in an elementary education setting. Teacher candidates will apply principles of planning, instruction, assessment, management, and professionalism in diverse field-based settings serving students in grades 2-6. Offered in Fall.','B440P',3,'Undergraduate')
,(603,13,'Mathematical Modeling','{ CSCI B419} (Prerequisite: grade of C or better in MATH B142 and CSCI B104, or consent of instructor) Utilizes numerical and mathematical analysis to investigate experimental data and complex systems in science and/or engineering. Emphasis is on the mathematical modeling techniques and computer programming to explore applied problems.','B419',3,'Undergraduate')
,(604,42,'Mathematical Modeling','{MATH B419} (Prerequisite: grade of C or better in MATH B142 and CSCI B104, or consent of instructor) Utilizes numerical and mathematical analysis to investigate experimental data and complex systems in science and/or engineering. Emphasis is on the mathematical modeling techniques and computer programming to explore applied problems.','B419',4,'Undergraduate')
,(605,42,'Mathematical Modeling for the Life Sciences','(Prerequisite: Grade of C or better in MATH B122 or MATH B141) Modeling with difference equations; vectors, trigonometry, polar coordinates, matrices, eigenvalues and eigenvectors; addition and multiplication in combinatorics, permutations, combinations, introduction to probability theory (discrete, continuous); techniques of integration, symmetry. Credit may not be received for both MATH B172 and either MATH B170 or B174. Offered Spring semester.','B172',3,'Undergraduate')
,(606,42,'Mathematics for Secondary Teachers','Survey of properties and algebra of real numbers and complex numbers; properties and representations of various functions; concepts of calculus; Euclidean and non-Euclidean geometries; applications of probability, data analysis, and discrete mathematics.','B421',3,'Undergraduate')
,(607,11,'Media and Society','An introduction to the history, evolution and cultural impact of traditional and digital platforms, enabling students to develop a critical perspective of media content.','B240',3,'Undergraduate')
,(608,41,'Media Design','Fundamental conceptual and technical aspects of designing popular media, including an introduction to digital compositing, time-based media, and interactive media.','B102',3,'Undergraduate')
,(609,3,'Medical Anthropology','(Prerequisites: Sophomore standing or higher) Socio-cultural factors in health, illness, healing and in medical systems. Crosscultural and ethnographic evidence for public health research and program applications. (Satisfies USCB General Education Global Citizenship and Multicultural Understanding Requirement).','B452',3,'Undergraduate')
,(610,9,'Medical Parasitology','(Prerequisite: a grade of C or better in two of the three core courses: BIOL B301, B302, B303; Corequisite: BIOL B461L) The goal of this course is to introduce students to a phylogenetic/taxonomic overview of major groups of parasites with emphasis on parasites that are of medical or veterinary importance.','B461',3,'Undergraduate')
,(611,9,'Medical Parasitology Laboratory','(Prerequisite: BIOL B302 & B303. Corequisite: BIOL B461) The goal of this course is to introduce students to a phylogenetic/taxonomic overview of major groups of parasites and develop laboratory skills in parasite identification and morphology.','B461L',1,'Undergraduate')
,(612,34,'Mezzo Level Human Services Interventions','(Prerequisite: HMSV B280 or consent of Instructor.) Exploration of the theories, skills and practice of working with small groups in human services settings. Includes understanding group dynamics, managing and facilitating educational and prevention groups, self-help and support groups, and families. Multicultural and ethical/legal issues related to this level of intervention will be examined.','B282',3,'Undergraduate')
,(613,34,'Micro Level Human Service Interventions','(Prerequisite or co-requisite: HMSV B190 or consent of Instructor.) Exploration of the theories, skills and practices of working one-on one in human services settings. Includes active listening, communication skills, and interviewing techniques, the development of service plans, crisis intervention, short and long term care, case management and information and referral services. Multicultural and ethical/legal issues related to this level of intervention will be examined.','B280',3,'Undergraduate')
,(614,9,'Microbiology','(Prerequisite: college-level biology) An introduction to bacteria and viruses, emphasizing structure, metabolism and pathogenesis. Discussion of infectious diseases, antigen-antibody relationships and anti-microbial agents in chemotherapy. Not available for biology major credit. Three lecture and three laboratory hours per week.','B230',4,'Undergraduate')
,(615,15,'Microeconomics','(Prerequisite: MATH B111 with a grade of C or higher) Microeconomic analysis theory of the firm, market structure, cost and output determination; market pricing; income distribution and international economics.','B221',3,'Undergraduate')
,(616,26,'Milton','Miltons works, with special attention to Paradise Lost.','B407',3,'Undergraduate')
,(617,56,'Minority Group Relations','Theories, methods and substantive issues in the study of majority-minority group relations and social processes and cultural orientations associated with racial and ethnic differentiation.','B355',3,'Undergraduate')
,(618,38,'Mobile Application Development','{CSCI B250} (Prerequisite: CSCI B145 with grade of C or better, or consent.) Introduction to Mobile application development fundamentals including development platforms, user interface design, data persistence, map Application Programming Interface.','B250',3,'Undergraduate')
