,(620,38,'Modeling and Simulation','{CSCI B450} (Prerequisite: CSCI B350 or consent, and STAT B340) An introduction to modeling and simulation. Topics include fundamental techniques in designing, coding, and use of simulation software to represent actual or theoretical systems in order to observe their behavior and evaluate design correctness.','B450',3,'Undergraduate')
