,(629,26,'Modernism','{ENGL B385} Literature of Modernism in its cultural contexts, explored through representative works.','B385',3,'Undergraduate')
,(630,9,'Molecular Marine Ecology','(Prerequisite: a grade of C or better in two of the three core courses: BIOL B301, B302, B303) Investigation of techniques and analysis of molecular data in marine organisms. Hands-on experience using molecular tools to investigate population genetic, ecological and systematic principles.','B480',3,'Undergraduate')
,(631,15,'Money and Banking','(Prerequisites: ECON B221, B222) The role of money in the market economy. Commercial banks, the Federal Reserve System and monetary policy.','B301',3,'Undergraduate')
,(632,41,'Narrative Media','(Prerequisite: MART B310 or permission by instructor) Advanced project-based course on telling a story through moving pictures, including taking a script through the 3D production process to a festival quality short animation.','B410',3,'Undergraduate')
,(633,9,'Neurobiology','(Prerequisite: a grade of C or better in two of the three core courses: BIOL B301, B302, B303) Descriptive and experimental aspects of the neural basis of behavior, emphasizing cellular and molecular mechanisms. Three lecture hours per week.','B435',3,'Undergraduate')
