,(635,34,'Nonprofit Management and Funding','(Prerequisite: HMSV B400 or consent of Instructor) Principles, theories, skills and practices of effective nonprofit management, including the following topics: governance, legal structures and standards, strategic planning, fundraising and proposal development, volunteer management, marketing and communication.','B402',3,'Undergraduate')
,(636,3,'North American Indian Cultures','Comparative study of ethnographic data on American Indian cultures, with emphasis on their significance for ethnological theory. (Satisfies USCB General Education Global Citizenship and Multicultural Understanding Requirement).','B317',3,'Undergraduate')
