,(638,42,'Numerical Analysis','(Prerequisite: MATH B280 or B242, and MATH B230) Interpolation and approximation of functions; solution of algebraic equations; numerical differentiation and integration; numerical solutions of ordinary differential equations and boundary value problems; computer implementation of algorithms.','B427',3,'Undergraduate')
,(639,13,'Numerical Analysis and Computing','{MATH B502} (Prerequisite: CSCI B280 and MATH B240 [or demonstrated equivalent knowledge/experience], or consent of instructor) Application of tools and techniques to algorithmic problems arising in discrete applied math. Topics include probabilistic methods, entropy, linear algebra methods, risk analysis, approximation and optimization techniques, and performance analysis.','B502',3,'Graduate')
,(640,48,'Nursing Concepts in Adult Health','(Prerequisite: Junior Standing) This class will help bridge an identified learning gap between NURS B326 and NURS B425.  The class will reinforce knowledge and application in Adult Health Nursing using a concept-based approach. The content will focus on critical thinking and clinical judgement utilizing the nursing process.','B357',3,'Undergraduate')
,(641,48,'Nursing Honors Seminar','(Prerequisite: Acceptance to the BSN Honors Program) This honors course is designed to provide students the opportunity to explore the changing role of nursing in the American healthcare system. Seminar meetings and planned excursions will facilitate scholarly exploration of the practice of nursing, with an emphasis on the factors influencing current and future nursing practice.','B100',1,'Undergraduate')
,(642,48,'Nursing Honors Seminar II','(Prerequisite: NURS B100) This honors course is designed to provide students with the opportunity to explore the changing role of nursing in the American healthcare system. Seminar meeting and planned excursions will facilitate scholarly exploration of the scope of practice including direct care roles and indirect care roles of the nurse and their influence on health policy and the health of populations across the nation.','B101',1,'Undergraduate')
,(643,48,'Nursing Honors Seminar III','(Prerequisite: NURS B101) This honors course is designed to provide students the opportunity to explore changing role of nursing across the globe. Seminar meetings and planned excursions will facilitate scholarly exploration of nursing practice, comparing and contrasting nursing practice in developed and developing countries with the United States. Emphasis is placed on the social determinants of health that influence disease prevention and health.','B200',1,'Undergraduate')
,(644,48,'Nursing Honors Seminar IV','(Prerequisite: NURS B200) This honors course is designed to provide students the opportunity to explore the changing role of nursing to improve the health of others. Through seminar meetings and experiential leaning, students will pursue a scholarly exploration of the healthcare system and health needs of populations at the regional, state, national or international level, culminating in a service-learning project focused on the leading health indicators of the Centers for Disease Control and Prevention (CDC) Healthy People 2020.','B201',1,'Undergraduate')
,(645,48,'Nursing Informatics and Technology in Healthcare','"(Prerequisite: NURS B202 or NURS B301) This course introduces nursing informatics and patient care technologies utilized in healthcare settings. Students explore informatics and technology from identification, retrieval, processing, evaluation, and management of healthcare technology and information systems intended to improve patient outcomes and reduce risk of harm. Legal and ethical considerations related to these technologies are examined. Emphasis is placed on selected technologies and evaluating how they impact nursing practice and influence quality and safety across the continuum of care. Basic computer literacy is a pre-requisite to support success.','B325',3,'Undergraduate')
,(646,54,'Nutrition','{HRTM B242} Introductory course on human nutrition. Includes principles of normal nutrition, basics of life cycle nutrition, relationship of nutrients to health and disease, and discussion of current issues.','B242',3,'Undergraduate')
,(647,35,'Nutrition','{PUBH B242} Introductory course on human nutrition. Includes principles of normal nutrition, basics of life cycle nutrition, relationship of nutrients to health and disease, and discussion of current issues.','B242',3,'Undergraduate')
,(648,54,'Nutrition and Chronic Disease','(Prerequisite: HRTM/PUBH B242) Explore the relationship of food, diet and lifestyle choices to the prevention and management of various chronic diseases. Main topic areas include type 2 diabetes, cardiovascular disease, digestive health, obesity and cancer.','B328',3,'Undergraduate')
,(649,54,'Nutrition and Metabolism','(Prerequisite: PUBH/HRTM B242, BIOL B110, and a 3-4 credit hour CHEM course) Examines the physiology and metabolism of micro and macro nutrients, and how principles of nutrition impact metabolic regulation.','B431',3,'Undergraduate')
,(650,38,'Object-Oriented Programming I','{CSCI B145} (Prerequisite: C or better in MATH B111 or higher or consent) Problem solving, algorithmic design, and programming. Open to all majors.','B145',4,'Undergraduate')
,(651,13,'Object-Oriented Programming I','{ISAT B145} (Prerequisite: C or better in MATH B111 or higher or consent) Problem solving, algorithmic design, and programming. Open to all majors.','B145',4,'Undergraduate')
,(652,38,'Object-Oriented Programming II','{CSCI B146} (Prerequisite: Grade of C or better in CSCI B145 and grade of C or better in MATH B141 or B174; Co-requisite: MATH B174) Continuation of CSCI 145. Rigorous development of algorithms and computer programs; elementary data structures. Three lecture hours and two laboratory hours per week. Open to all majors.','B146',4,'Undergraduate')
,(653,13,'Object-Oriented Programming II','{ISAT B146} (Prerequisite: Grade of C or better in CSCI B145 and grade of C or better in MATH B141 or B174; Co-requisite: MATH B174) Continuation of CSCI 145. Rigorous development of algorithms and computer programs; elementary data structures. Three lecture hours and two laboratory hours per week. Open to all majors.','B146',4,'Undergraduate')
,(654,46,'Oceans and Society','A non-technical introduction to the oceans: organisms, systems and the physical and chemical characteristics. Laboratories illustrate the structure and function of marine environments. Three lecture and two laboratory hours per week. Attendance on field trips may be required.','B210',4,'Undergraduate')
,(655,13,'Operating Systems','(Prerequisite: CSCI B145 or a high-level programming language). Introduction to operating systems. Topics include evolution of operating systems, components and performance, process management, memory management, file systems, security and advanced topics.','B360',3,'Undergraduate')
,(656,43,'Operations and Supply Chain Management','(Prerequisites: MGMT B371 and STAT B201) A study of the strategic, operating and control decisions involved in manufacturing and service organizations. Topics include forecasting, process development, production technology, resource allocation, facility planning, facility layout, planning systems, inventory systems, resource requirements planning systems, shop floor planning, scheduling operations, just-in-time manufacturing, materials management, productivity control, quality management, quality control, project management and lean Six Sigma.','B475',3,'Undergraduate')
,(657,57,'Oral Communication','(Prerequisite: FREN B201 or by placement) Practice in conversation involving authentic materials; vocabulary building at the intermediate level.','B202',3,'Undergraduate')
,(658,29,'Oral Communication','(Prerequisite: SPAN B201, score on placement exam or consent of instructor, SPAN B202 is a continuation of SPAN B201). Review and further expansion of oral and written communication skills, reading of authentic materials and understanding of cultural and social topics, including Hispanics and Latinx in the United States. Intermediate language course.','B202',3,'Undergraduate')
,(659,11,'Oral Interpretation of Literature','{COMM B340} A course designed to give an understanding of the principles involved in extracting meaning from the printed page and the oral presentation of that meaning in a lucid and stimulating manner.','B340',3,'Undergraduate')
,(660,60,'Oral Interpretation of Literature','{THEA B340} A course designed to give an understanding of the principals involved in extracting meaning from the printed page and the oral presentation of that meaning in a lucid and stimulating manner.','B340',3,'Undergraduate')
,(661,10,'Organic Chemistry I','(Prerequisite: CHEM B112) Contemporary theories, nomenclature, reactions, mechanisms and syntheses of carbon compounds. Three lecture hours per week.','B333',3,'Undergraduate')
,(662,10,'Organic Chemistry II','(Prerequisite: Grade of C or better in CHEM B333, or with consent of instructor, CHEM B331) Continuation of CHEM B333. Three lecture hours per week.','B334',3,'Undergraduate')
,(663,16,'Organization & Management in the Secondary Classroom','(Prerequisite: Admission into the Professional Program) Structuring of the physical, social, and instructional environment to maximize learning in a supportive, diverse secondary classroom. Development of a comprehensive understanding of practice, proactive, and reactive approaches to management with attention to motivation and culturally diverse settings will be addressed. Behaviorist and constructivist approaches, inclusive education, ESOL learner needs, conflict resolution, ABC Analysis, and the promotion of learning communities are components of this course.','B442',3,'Undergraduate')
,(664,16,'Organization and Management in the Diverse Classroom','(Prerequisite: Admission to the Department of Education''s Teacher Education Professional Program for Elementary Education or Early Childhood Education) Structuring of the physical, social, and instructional environment to maximize learning in a supportive, diverse classroom. Development of a comprehensive understanding of practice, proactive, and reactive approaches to management with attention to motivation and culturally diverse settings will be addressed. Behaviorists and constructivist approaches, inclusive education, ESOL learner needs, conflict resolution, and the promotion of learning communities are components of this course.','B441',3,'Undergraduate')
,(665,43,'Organization Behavior','(Prerequisite: MGMT B371) A study of the process of integrating people into a work situation that motivates them to work together productively, cooperatively and with economic, psychological and social satisfaction.','B376',3,'Undergraduate')
,(666,43,'Organization Theory','(Prerequisite: MGMT B376) A conceptual framework for the orderly analysis of management functions through studies in organization planning and control theories.','B477',3,'Undergraduate')
,(667,11,'Organizational Communication','Fundamentals of oral communication within business and professional settings. Includes performance.','B230',3,'Undergraduate')
,(668,6,'Painting I','(Prerequisite: ARTS B102, B103, B104, and B111) An introduction to painting that covers materials, techniques and related historical influences on the medium.','B210',3,'Undergraduate')
,(669,6,'Painting II','(Prerequisite: ARTS B102, B103, B104, B111, and B210) A continued exploration of the materials and techniques of painting with emphasis on individual creative expression.','B310',3,'Undergraduate')
,(670,6,'Painting III','(Prerequisite: ARTS B102, B103, B104, B111, and B310) Further development of technical and creative expression.','B311',3,'Undergraduate')
,(671,48,'Pathophysiology','(Prerequisite: Acceptance to the Pre-licensure or RN to BSN Program or consent of Instructor). Building on prior science courses, this course advances knowledge of pathophysiology by analyzing the molecular, cellular and organ system changes that occur with common diseases, noting their impact on total body function and homeostasis. Focus is on the mechanisms of underlying diseases needed to deliver preventive and therapeutic health care interventions.','B310',3,'Undergraduate')
,(672,43,'Pay, Rewards, and Compensation Management','An examination of how organizations use pay and other types of rewards (both intrinsic and extrinsic) to affect employee motivation and behavior.','B404',3,'Undergraduate')
,(673,48,'Performance of Caring','{NURS B341} (Prerequisite: SOCY B101 or PSYC B101) The class aims to train students to act as Simulated Participants (SP) in the Nursing Simulation lab as patients and supporting roles (such as patient family members) in dynamic, realistic simulated healthcare experiences. These experiences help train future nurses in a lifelike way.','B341',3,'Undergraduate')
,(674,60,'Performance of Caring','{THEA B341} (Prerequisite: SOCY B101 or PSYC B101) The class aims to train students to act as Simulated Participants (SP) in the Nursing Simulation lab as patients and supporting roles (such as patient family members) in dynamic, realistic simulated healthcare experiences. These experiences help train future nurses in a lifelike way.','B341',3,'Undergraduate')
,(675,41,'Performative Media','(Prerequisite: MART B381 or permission of instructor) Advanced project-based course on the design and practice of media performance, including the development of interactive virtual characters and environments for a live stage production.','B481',3,'Undergraduate')
,(676,60,'Performing Shakespeare','(Prerequisite: THEA B170) This class helps students develop a mastery of methods that enable one to perform the works of Shakespeare with confidence and competence.','B430',3,'Undergraduate')
,(677,34,'Personal an Professional Development in Human Services','(Prerequisite: PSYC B101 or SOCY B101 or consent of Instructor) This course provided students with the opportunity to explore their personal and professional development and understand how values, beliefs and norms impact both personal and professional lives.','B180',3,'Undergraduate')
,(678,22,'Personal and Community Health','(Prerequisite or Co-requisite: EDCI B100) A study of the principles and practices of personal and community health and their application to the health education of the young child.','B231',3,'Undergraduate')
,(679,49,'Personal Fitness and Weight Control','Assessment of major fitness components and development of a personalized exercise program based on fundamental principles of exercise prescription. Weight management and dietary guidelines will be addressed.','B104',1,'Undergraduate')
,(680,45,'Personal Selling and Sales','(Prerequisite: MKTG B350) This course is a comprehensive survey of the basic process of personal selling and sales management applicable to all forms of business. The course is intended to provide the student with a basis for developing personal selling skills as well as understanding the fundamentals of sales management.','B457',3,'Undergraduate')
,(681,53,'Personality Theory','(Prerequisite: PSYC B101) Covers the major theories and research on personality and the dynamics of human motivation.','B341',3,'Undergraduate')
,(682,56,'Perspectives in Public Sociology','(Prerequisite: SOCY B101 or consent of instructor) Introduces students to the ways sociologists contribute to issues on the public agenda through the interpretation and dissemination of sociological data and knowledge. Students will be introduced to practical and marketable skills for working as sociologists. Can include emphasis on the ways sociologists create tools, speak out, or write for a broad audience. May be repeated or taken simultaneously as topics vary. Variations will be announced in the schedule of classes by topic title.','B378',3,'Undergraduate')
,(683,11,'Persuasion & Social Influence','An in-depth exploration of the art and science of persuasion and social influence. Topics of study include definitions and models of persuasion, individual communicator characteristics important in the complex process of persuasion, conformity and influence in groups, persuasive language and nonverbal cues, principles of rhetoric and rhetorical devices, compliance-gaining communication, motivational appeals, deception, and the ethical dimensions of persuasion and social influence.','B308',3,'Undergraduate')
,(684,48,'Pharmacologic Interventions','(Prerequisite: NURS B310 or consent of instructor) Pharmacokinetics, pharmacodynamics and pharmacogenetics are studied from a drug classification typology. The nurses role in verifying and validating drug prescriptions, calculating dosages, administering will build previous learning. Assisting patients with the management of side effects, drug discontinuation, and iatrogenic complications are studied. Current issues with poly-pharmaceuticals, addiction, and self-management with over-the-counter and herbal usage will be discussed from an evidence- and ethically-based practice perspective.','B320',3,'Undergraduate')
,(685,50,'Philosophy of Art','Philosophical problems relating to the arts, with emphasis on questions pertaining to aesthetic experience.','B313',3,'Undergraduate')
,(686,50,'Philosophy of Film','{IDST B363} (Prerequisite: ENGL B101/B105 and ENGL B102/B106) Interdisciplinary course with emphasis on topical study of film theory, the aesthetics of film as an art form, the social impact and relevance of film.','B363',3,'Undergraduate')
,(687,36,'Philosophy of Film','{PHIL B363} (Prerequisite: ENGL B101/B105 and ENGL B102/B106) Interdisciplinary course with emphasis on topical study of film theory, the aesthetics of film as an art form, the social impact and relevance of film.','B363',3,'Undergraduate')
,(688,50,'Philosophy of Human Nature','This course investigates particular interpretations of human nature that have arisen within the history of ideas. Particular focus will be given to 1) analyzing the conflicting claims regarding human behavior that arise from such interpretations and 2) evaluating disagreements regarding the norms of conduct and social policy that develop from these different interpretations.','B212',3,'Undergraduate')
,(689,50,'Philosophy of Technology','This course will focus on the various philosophical questions and issues that arise from the technological opportunities and challenges of the 21st century. Philosophical topics surrounding technology will include those related to ethics, the philosophy of language, feminism, critical theory, and pragmatism. Possible topics regarding technology may include information technologies, robotics, AI, genetic engineering, cyborgs, climate change/geoengineering/the Anthropocene, and social media technologies. Finally, we investigate how technological developments stimulate philosophical thinking.','B315',3,'Undergraduate')
,(690,35,'Physical Plant Design','Design, equipment and maintenance of hospitality facilities.','B355',3,'Undergraduate')
,(691,9,'Plant Science','An introduction to plant science for the non-major. This course does not carry major credit and is not designed as a prerequisite for other biology courses. Plant development, physiology, genetics, evolution and ecology will be considered. Three lecture hours per week.','B200',3,'Undergraduate')
,(692,9,'Plant Science Laboratory','(Prerequisite or Co-requisite: BIOL B200) Laboratory exercises, demonstrations and audiovisual supplements to BIOL B200. Two hours per week. Not for major credit.','B200L',1,'Undergraduate')
,(693,26,'Playwriting','{ ENGL B322} (Prerequisite: Junior level or consent of instructor) A workshop approach to playwriting that culminates in each student creating a production-ready one-act play. May be repeated with consent of instructor for a maximum of 6 credit hours.','B322',3,'Undergraduate')
,(694,60,'Playwriting','{ THEA B322} (Prerequisite: ENGL B101 or B105, and ENGL B102 or B106, each with a C or higher.) A workshop approach to playwriting that culminates in each student creating a production-ready one-act play. May be repeated with consent of instructor for a maximum of 6 credit hours.','B322',3,'Undergraduate')
,(695,26,'Poetry','(Prerequisite: ENGL B101 or B105 & B102 or B106, and one literature course at the 200-level or higher) Seminar that focuses on poetic genres and forms through a study of particular texts and writers, or networks of texts and writers.','B430',3,'Undergraduate')
,(696,26,'Poetry Workshop','May be repeated with consent of instructor for a maximum of 6 credit hours.','B464',3,'Undergraduate')
,(697,53,'Positive Psychology','(Prerequisite: PSYC B101 and Junior or Senior standing) Research and theories on psychological well-being and happiness. Topics include subjective well-being, positive affect and emotions, flow, resilience, correlates of happiness, self-regulation, virtues and character, interpersonal relationships, and mindfulness.','B409',3,'Undergraduate')
,(698,12,'Postmodernism','{CPLT B386} Literature of Postmodernism in its cultural contexts, explored through representative works.','B386',3,'Undergraduate')
,(699,12,'Postmodernism','{ENGL B386} Literature of Postmodernism in its cultural contexts, explored through representative works.','B386',3,'Undergraduate')
,(700,11,'Power, Discourse & Social Identity','(Prerequisite: Junior standing or instructor permission) This course examines notions of identity in public discourse. Students will be introduced to theories of discourse, identity, and power in public discourse (i.e. legal, mediated, policy, etc.) on current social issues.','B404',3,'Undergraduate')
,(701,13,'Practical Computing for Computational Scientists','(Prerequisite: Enrollment in CSCI M.S. program OR consent of instructor) Application of mathematical, science, and engineering problems to software engineering. Introduction to operating systems including UNIX/LINUX.','B500',3,'Graduate')
,(702,35,'Practicum','Supervised full-time work experience in an area of the hospitality industry, selected by the student and approved by the practicum coordinator.','B290',3,'Undergraduate')
,(703,24,'Practicum in Assessing & Teaching English Language Learners','(Prerequisite: Department Permission) Supervised clinical experience in literacy that is implemented within the classroom. Candidates will practice proficiency in planning, assessing, and teaching using various methods of reading and writing that serve the needs of English Language Learners. The main assessment for this course is a diagnostic reading case study.','B640P',3,'Graduate')
,(704,21,'Practicum in Teaching Mathematics in the Secondary School','(Co-requisite: EDME B430) Supervised clinical experience in a secondary mathematics setting. Observation and participation in a classroom setting is required.','B430P',3,'Undergraduate')
,(705,17,'Practicum: Teaching Integrated Lessons in Early Childhood Education','(Prerequisite: Admission to the Professional Program or consent of the Department Chair; Co-requisite EDEC B435, EDEC B436, and EDEC B444). Supervised clinical experience in an early childhood setting. Teacher candidates will apply principles of planning, instruction, assessment, management, and professionalism in diverse field-based settings serving students in grades P-3. Offered in Fall.','B440P',3,'Undergraduate')
,(706,42,'Precalculus Mathematics','(Prerequisite: Qualification through placement or a grade of C or better in B111) Topics in algebra and trigonometry specifically needed for MATH 141, 142, 240. Polynomial, rational, inverse, logarithmic, exponential functions; circular functions; analytic trigonometry. Offered every semester.','B115',4,'Undergraduate')
,(707,61,'Pre-Nursing Student in the University','University 150 is designed to help first-year pre-nursing students understand and adjust to the demands of the nursing major, acquire essential academic success skills to be successful, and better understand the nursing field as well as adjacent vocations.','B150',1,'Undergraduate')
,(708,3,'Primates, People and Prehistory','An exploration of human origins, human evolution, human prehistory and cultural existence from its less complex forms to early civilizations. An introduction to the concepts, methods and data of physical, biological and archaeological anthropology. May be taken with, or independently of, ANTH B102. Satisfies 3-credit hour course requirement for Natural Science GE.','B101',3,'Undergraduate')
,(709,3,'Principles of Archaeology','An introduction to the principles, methods, and theory of archaeology, including prehistoric and historic case studies.','B319',3,'Undergraduate')
,(710,10,'Principles of Biochemistry','{BIOL 441} (Prerequisite: CHEM B333) A survey of fundamentals of biochemistry.','B450',3,'Undergraduate')
,(711,9,'Principles of Biochemistry','{CHEM B450} (Prerequisite: CHEM B333) A survey of fundamentals of biochemistry.','B441',3,'Undergraduate')
