,(714,13,'Principles of Computer Security','Prerequisite: CSCI B201 [or demonstrated equivalent knowledge/experience] or consent of instructor) Principles and practices of computer system security including operating system security, network security, software security and web security.','B601',3,'Graduate')
,(715,54,'Principles of Epidemiology','(Prerequisite: PUBH B310) The study of the patterns, causes, and effects of health and disease.','B330',3,'Undergraduate')
