,(718,34,'Principles of Gerontology','(HMSV B303 & PSYC B303) An exploration of the interdisciplinary field of gerontology, including the fundamental concepts, theories, and issues involved in the study of aging from diverse perspectives.','B303',3,'Undergraduate')
,(719,53,'Principles of Gerontology','(HMSV B303 & SOCY B303) An exploration of the interdisciplinary field of gerontology, including the fundamental concepts, theories, and issues involved in the study of aging from diverse perspectives.','B303',3,'Undergraduate')
,(720,34,'Principles of Gerontology','(PSYC B303 & SOCY B303) An exploration of the interdisciplinary field of gerontology, including the fundamental concepts, theories, and issues involved in the study of aging from diverse perspectives.','B303',3,'Undergraduate')
,(721,35,'Principles of Hospitality Retail Management','Management methods, location analysis, store organization, personnel, planning, buying and pricing techniques and customer service policies for retail firms; including retail outlets in hotels, restaurants, private clubs and recreation facilitates catering to golf and tennis.','B265',3,'Undergraduate')
,(722,43,'Principles of Management and Leadership','(Prerequisite: Junior standing) A comprehensive survey of the basic principles of management and leadership applicable to all forms of business. The course provides the student with a basis for thinking about complex business situations in the framework of analysis of the management and leadership process.','B371',3,'Undergraduate')
,(723,45,'Principles of Marketing','(Prerequisites: ECON B221) Principles and concepts underlying marketing functions, including the conception, pricing, promotion and distribution of products and services and the role of marketing in society.','B350',3,'Undergraduate')
,(724,26,'Principles of Modern Literary Theory','Major 20th-century approaches to texts, from New Criticism to the present.','B442',3,'Undergraduate')
,(725,6,'Printmaking I','(Prerequisite: ARTS B102, B103, B104, and B111) An introductory course in printmaking with emphasis on relief processes.','B215',3,'Undergraduate')
,(726,6,'Printmaking II','(Prerequisite: ARTS B102, B103, B104, B111, and B215) Relief and intaglio techniques including the execution of original works in these media.','B315',3,'Undergraduate')
,(727,6,'Printmaking III','(Prerequisite: ARTS B102, B103, B104, B111, and B315) Intaglio and lithography techniques including the execution of original works in these media.','B316',3,'Undergraduate')
,(728,35,'Professional Development in Hospitality Management','Course focuses on preparing students for successful job searches and thriving in entry-level management positions in the hospitality industry.','B245',3,'Undergraduate')
,(729,48,'Professional Nursing Seminar','(Prerequisite: NURS B412, B418, & B422C) Students will prepare a personalized career plan that is consistent with an intentional career focus. Documents needed to apply for licensure, jobs, and continuing education will be developed and refined. Interviewing skills needed for applying for jobs and graduate level education are rehearsed. The use of social media in job procurement is presented. Readiness for NCLEX-RN and achievement of licensure will be emphasized.','B435',2,'Undergraduate')
,(730,26,'Professional Writing Practicum','(Prerequisite: ENGL B101 or B105, and ENGL B102 or B106, each with a C or higher.) A practicum in professional writing, allowing students to complete projects that employ skills in visual rhetoric, writing, editing, proofreading, and/or research in an on-campus workplace setting. (May be repeated for up to 2 credits)','B266',3,'Undergraduate')
