,(870,16,'Teacher Cadet II','(Prerequisite: EDCI B100) This course focuses on the dynamics of human learning and the psychological principles that serve as the foundation for educational practice. The general goal is to provide a basic introduction to research findings from the discipline of psychology that can be used to inform the planning and implementation of effective instructional practices in the classroom.','B201',3,'Undergraduate')
,(871,18,'Teaching Mathematics in the Elementary School','(Prerequisite: Admission to the Department of Education''s Professional Program for Elementary Education) Materials, resources, programs, and methods for teaching mathematics to diverse learners in grades 2-6. Problem solving, mathematical content and process connections, as well as assessment, diagnosis, and remediation will be addressed. Included are supervised practicum experiences that promote reflective teaching in elementary school settings.','B431',3,'Undergraduate')
