,(874,18,'Teaching Science in the Elementary School','(Prerequisite: Admission to the Department of Education''s Professional Program for Elementary Education) Materials, resources, programs, and methods for teaching science in an inquiry format to diverse learners in grades 2-6. Included are supervised practicum experiences that promote reflective teaching in elementary school settings.','B432',3,'Undergraduate')
