,(903,48,'The Science of Evidence-Based Practice','(Prerequisite: STAT B201 and NURS B202 or RN Licensure or consent of Instructor) The science of nursing is presented exploring how research builds the nursing profession. The research process, from question to study design and analysis, and onto field-based implementation is contrasted. Students are exposed to multiple studies sufficient to inform evidence-based practice and discern good from bad science. Discussion of institutional databases available to inform quality improvement and organizational policy is explained. Ethical concerns and the mitigation of research risks are considered.','B350',3,'Undergraduate')
