,(905,26,'The Teaching of Writing','(Prerequisite: ENGL B101 or B105 & B102 or B106, each with a grade of C or higher.) Theory and methods of teaching composition and extensive practice in various kinds of writing. Recommended for prospective writing teachers.','B470',3,'Undergraduate')
