,(922,36,'Topics in Cultural Historiography','(Prerequisite: ENGL B101 or B105, and B102 or B106, each with a grade of C or higher.) Intensive interdisciplinary study of selected topics regarding cultural history. Open to all majors. Can be repeated up to two times (6 credit hours). Topic reflected in section number.','B331',3,'Undergraduate')
