,(934,54,'Transcultural Health','(Prerequisite: PSYC B101 or SOCY B101 or consent of instructor) This course surveys the cultural and social dimensions of health and illness with emphasis on the development of cultural competence. Different populations are examined for the development of a personal understanding of the traditions and customs of their societies, providing a unique perspective on the implications for patient care. (Satisfies USCB General Education Global Citizenship and Multicultural Understanding Requirement).','B300',3,'Undergraduate')
,(935,48,'Transcultural Health Practices','(Prerequisite: PSYC B101 or SOCY B101 or consent of instructor) This course focuses on the health practices of individual, family and communities with varied cultural, socioeconomic, and global backgrounds. Cultural variables such as age, gender, ethnicity, family structure, spiritual practice and religion, sexual expression, economics, and common health practices are examined to sensitize providers to person-centered care. Cultural practices in birth, health, pain management, natural healing practices, illness and death are explained and reinforced.','B330',3,'Undergraduate')
,(936,53,'Trauma & Recovery','(Prerequisite: PSYC B311 or equivalent) This course will provide an overall theoretical basis for trauma assessment and intervention. Students will learn the overview of trauma & recovery from crime scene to therapy couch. Topics include legal, social, and behavioral concepts of trauma, trauma theory, treatment options, and stages of recovery.','B413',3,'Undergraduate')
,(937,48,'Trends and Issues in Nursing','(Prerequisite: NURS B356 and NURS B358 for pre-licensure students) Historical and present trends in nursing practice are taught in this course with a perspective on nursing education, genetic research, evidenced-based practice and complementary therapies (Lecture 3 hours).','B420',3,'Undergraduate')
,(938,26,'Tudor Literature','Poetry and prose of the 16th century.','B402',3,'Undergraduate')
,(939,33,'U.S. Constitutional History','(Prerequisite: completion of one of the following: HIST B101, B102, B111, B112, B115, B116. Of the six, HIST B111, or B112 which cover U.S. history are preferred, though not required.)United States Constitutional history including constitutional origins in English and colonial legal practices, writing and ratifying the Constitution, Supreme Court decisions, and changes in constitutional interpretation into the twentieth century. Course includes REACH Act Founding Documents.','B430',3,'Undergraduate')
