,(951,9,'Weekly Seminar in Science','(Prerequisite: Permission of instructor) Weekly seminar in science is a survey of scientific research seminars presented by both USCB researchers and visiting researchers from other institutions. Format is that of a departmental seminar. Grades are based on attendance and on a number of executive summaries of seminars by students taking the course for credit. Class can be taken up to 4 times under different semesters.','B290',1,'Undergraduate')
,(952,49,'Weight Training','An introduction to progressive resistance training and participation in a personalized strength training program with emphasis on proper technique and safety principles.','B105',1,'Undergraduate')
,(953,61,'Well-Being in the University','Well-Being in the University is designed to help first-year students who had experienced academic difficulties in their first semester better understand how their overall well-being impacts their success in college. Using a strengths-based approach, this course provides a general overview of the dimensions of wellness, helps students explore how their overall well-being effects their college success, and how they can use their strengths to overcome barriers to success in college.','B102',1,'Undergraduate')
