,(959,34,'Working with Older Adults','{HMSV/PSYC B403} (Prerequisite: SOCY/PSYC/HMSV B303 or SOCY B313 or PSYC B328, or consent of instructor) Provides students with hands-on experience in fields serving the growing older adult population. This is a service-learning course with a significant experiential component. Students will spend time engaged directly with older adults, learning from practitioners working with and in service to older adults, supporting caregivers for older adults, and reflecting on their own perceptions of aging.','B403',3,'Undergraduate')
