,(964,33,'World History from 1500 to Present','HIST 116 is the second of a two-semester survey of World History from the advent of the modern period (1500 C.E.) to the present. The course necessarily adopts a cross-cultural approach to the study and interpretation of the past, including political, intellectual, economic and social inquiry. HIST 116 addresses issues of religion, gender, trade, migration, conflict and interaction between and within societies. (Satisfies USCB General Education Global Citizenship and Multicultural Understanding Requirement).','B116',3,'Undergraduate')
,(965,33,'World History to 1500','HIST 115 is the first of a two-semester survey of World History from the origin of human civilizations to the advent of the modern period (1500 C.E.). The course necessarily adopts a cross-cultural approach to the study and interpretation of the past, including political, intellectual, economic and social inquiry. HIST 115 addresses issues of religion, gender, trade, migration, conflict and interaction between and within societies. (Satisfies USCB General Education Global Citizenship and Multicultural Understanding Requirement).','B115',3,'Undergraduate')
,(966,26,'World Literatures','(Prerequisite: ENGL B101 or B105, and ENGL B102 or B106, each with a C or higher.) Survey of world literatures, spanning ancient to postmodern texts. Appropriate for students from any discipline.','B270',3,'Undergraduate')
,(967,33,'World of the Ancient Greeks','An examination of the political, cultural, and social history of ancient Greece, from the emergence of the Polis in the eighth century to the death of Alexander in 323 BCE.','B302',3,'Undergraduate')
