,(971,11,'Writing Across Media Platforms','(Prerequisite: ENGL B101 or B105, and B102 or B106, each with a grade of C or higher, and COMM B140 and COMM B190) Students will learn practical skills to help them succeed in writing for specifically online news environments. Emphasis is given to clear and effective communication and professional standards as well as the need to tailor the message to the audience and the platform through which it is communicated.','B210',3,'Undergraduate')
,(972,24,'Writing Across the Curriculum','This course is designed to instruct graduate candidates, grades k-12 in developing methods and materials that will improve their students literacy skills in the content areas of math, social studies, science, and health. Emphasis is on the application of strategies that will support students in reading, writing, and working with media in the context of content area instruction.','B626',3,'Graduate')
