);


/*** VIEWS ***/

--View for Students information
DROP VIEW IF EXISTS VIEW_Students
GO

CREATE VIEW VIEW_Students AS
SELECT EnrolledCourses.StudentsID,
	   Students.FirstName,
	   Students.LastName,
	   FORMAT(AVG(GPA), 'N2') AS GPA, -- N2 specifies two decimal places after N, N = number
	   SUM(CreditHours) AS CreditHoursCompleted, -- Sum of Credit Hours
	   CASE
			WHEN SUM(CreditHours) <= 30 THEN '1st Year'
			WHEN SUM(CreditHours) <= 60 THEN '2nd Year'
			WHEN SUM(CreditHours) <= 90 THEN '3rd Year'
			WHEN SUM(CreditHours) <= 120 THEN '4th Year'
			WHEN SUM(CreditHours) >= 120 AND MAX(EnrollmentDate) = '2018-08-24' THEN '2022 Alumni'
			WHEN SUM(CreditHours) >= 120 AND MAX(EnrollmentDate) = '2019-08-24' THEN '2023 Alumni'
		END AS StudentClassification,
		Majors.MajorName
FROM EnrolledCourses
	INNER JOIN Grades
		ON EnrolledCourses.GradesID = Grades.GradesID
	INNER JOIN Students 
		ON EnrolledCourses.StudentsID = Students.StudentsID
	INNER JOIN CourseOfferings
		ON EnrolledCourses.CourseOfferingsID = CourseOfferings.CourseOfferingsID
	INNER JOIN Courses
		ON CourseOfferings.CoursesID = Courses.CoursesID
	INNER JOIN Majors
		ON Students.MajorsID = Majors.MajorsID
GROUP BY EnrolledCourses.StudentsID, Students.FirstName, Students.LastName, Majors.MajorName

GO

select * from VIEW_Students ORDER BY StudentsID
GO


-- View for 3rd Year ISAT student
DROP VIEW IF EXISTS VIEW_RandomStudent3rdYear
GO

CREATE VIEW VIEW_RandomStudent3rdYear AS
SELECT EnrolledCourses.StudentsID,
	   Subjects.SubjectsAbbr AS Subject,
	   CourseNumber,
	   CourseTitle,
	   Professors.LastName + ', ' + Professors.FirstName AS Professor,
	   CourseOfferings.CourseTermsID AS CourseTerms,
	   COALESCE(Grade, 'In Progress') AS Grade
FROM EnrolledCourses
	LEFT JOIN Students -- Left join in this query lets us retrive all rows from EnrolledCourses, INNER JOIN retrieves rows that are matching in both tables
		ON EnrolledCourses.StudentsID = Students.StudentsID
	LEFT JOIN CourseOfferings
		ON EnrolledCourses.CourseOfferingsID = CourseOfferings.CourseOfferingsID
	LEFT JOIN Courses
		ON CourseOfferings.CoursesID = Courses.CoursesID
	LEFT JOIN Subjects
		ON Courses.SubjectsID = Subjects.SubjectsID
	LEFT JOIN Professors
		ON CourseOfferings.ProfessorsID = Professors.ProfessorsID
	LEFT JOIN CourseTerms
		ON CourseOfferings.CourseTermsID = CourseTerms.CourseTermsID
	LEFT JOIN Grades
		ON EnrolledCourses.GradesID = Grades.GradesID
WHERE EnrolledCourses.StudentsID = 65

GO

select * from VIEW_RandomStudent3rdYear order by CourseTerms DESC
GO


-- View for Prerequisites
DROP VIEW IF EXISTS VIEW_PrerequisiteView
GO

CREATE VIEW VIEW_PrerequisiteView AS
select s1.SubjectsAbbr as [Prereq Subject], r1.CourseNumber as [Prereq CourseNumber], r1.CourseTitle as Prerequisite, 
	   s2.SubjectsAbbr as [Course Subject], r2.CourseNumber as [Course CourseNumber], r2.CourseTitle as Course
from Requisites
inner join Courses r1
on Requisites.ForCourseID = r1.CoursesID
inner join Courses r2
on Requisites.IsCourseID = r2.CoursesID
inner join Subjects s1
on r1.SubjectsID = s1.SubjectsID
inner join Subjects s2
on r2.SubjectsID = s2.SubjectsID

GO

select * from VIEW_PrerequisiteView
GO


